INSERT INTO `products` (`productCode`, `keywords`, `productLine`, `productName`, `image`, `productQuantity`, `price`, `producer`, `productDescription`) VALUES
(10001, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, răng,chó', 'Đồ dùng cho chó', 'Bộ chăm sóc răng Arquivet', 'https://salt.tikicdn.com/cache/200x200/ts/product/59/16/6d/b5f7b82ff31e7fd556e6019dd580754f.png', 50, 105000, 'OEM', 'Kem đánh răng Tthơm miệng cho chó - 100g, loại bỏ nguyên nhân gây vi khuẩn hôi miệng. Giúp ngăn ngừa mảng bám, cao răng, viêm nướu và duy trì sự khỏe mạnh cho răng'),
(10002, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, sữa, mùi, chó', 'Đồ dùng cho chó', 'Sữa tắm khử mùi DIVA', 'https://salt.tikicdn.com/cache/200x200/ts/product/3f/b7/eb/24b5e8157969b3ef4a82edb0ea386d1f.jpg', 50, 185000, 'DIVA', 'Nuôi dưỡng cho bộ lông thêm bóng mượt, hương thơm quyến rũ, không gây kích ứng da'),
(10003, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, sữa, da, chó', 'Đồ dùng cho chó', 'Sữa tắm bảo vệ da cho chó SOS', 'https://salt.tikicdn.com/cache/200x200/ts/product/2b/47/c8/0d538cd278d47f1c088d5e98946c89f3.jpg', 50, 91000, 'SOS', 'Là sản phẩm giúp phục hồi, bảo vệ da, ngăn ngừa viêm da và có tác dụng diệt ve nấm, bọ chét….Đây là loại chăm sóc lông, khử mùi, diệt khuẩn. Với công dụng làm sạch, chăm sóc da, loại bỏ bụi bẩn, khử mùi, diệt khuẩn, lưu giữ lại hương thơm lâu lên đến hơn 10 ngày, đặc biệt KHÔNG GÂY HẠI CHO DA phòng trừ ve rận cho tất cả các giống chó, với tính năng thích hợp cho nhiều giống chó, không gây kích ứng da.'),
(10004, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, mùi, chó', 'Đồ dùng cho chó', 'Bình xịt khử mùi dưỡng lông cho chó Baby Powder Budle\'Budle BB112 (530ml)', 'https://salt.tikicdn.com/cache/200x200/ts/product/5e/06/2a/e32da2b0d6fa7fdc5274843ecae384c0.jpg', 50, 150000, 'Budle\'Budle', 'Cải thiện bộ lông hư tổn, xơ rối, hương thơm nhẹ nhàng tự nhiên, giúp thú cưng luôn sảng khoái mà không bị kích ứng'),
(10005, 'Đồ ăn, chăm sóc, sức khỏe, chó, hạt, trưởng thành, ', 'Đồ ăn cho chó', 'Thức ăn hạt cao cấp dành cho cho trưởng thành giống chó nhỏ(dưới 25kg) Brit Care Adult', 'https://salt.tikicdn.com/cache/200x200/ts/product/6b/ae/ae/a61f313b1cad8d5d5e3e644af9bbffc9.jpg', 50, 160000, 'Brit', 'Công thức không chứa ngũ cốc với đạm dễ tiêu hóa, và chất béo không bão hòa để cho sự phát triển tối ưu của cơ và thể chất. Chỉ số đường huyết thấp để duy trì lượng đường máu ở mức tối ưu và giảm nguy cơ bị béo phì, Axit béo omega-3 cao cho một trái tim và làn da khỏe, và một bộ lông óng ả và dày dặn.'),
(10006, 'Thuốc, chăm sóc, sức khỏe, vệ sinh, rận, chó', 'Thuốc thú y', 'Thuốc nhỏ rận Bayer Advocate', 'https://salt.tikicdn.com/cache/200x200/ts/product/bd/d4/9c/a3e7c05d578e4711a23f9646ecfd52c1.jpg', 50, 110000, 'BAYER', 'Giúp phòng và cắt sự quấy rối của ve và bọ chét, tiêu diệt trứng, nhộng và bọ chét trưởng thành, phòng và kiểm soát tái nhiễm, thuốc có tác động nhanh, kéo dài, không thấm nước'),
(10007, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, dầu, chó', 'Đồ dùng cho chó', 'Dầu gội cho chó Ostech', 'https://salt.tikicdn.com/cache/200x200/ts/product/b6/d4/3d/282165fcf2c25b393dbf2017909f71c1.jpg', 50, 105000, 'OSTECH', 'Chống kích ứng da, giống độ pH dành cho da em bé, không có chất tạo bọt là chất làm khô da, Ionic là 1 trong những nguyên nhân gây dị ứng, là gội, dầu xả và còn là kem dưỡng ẩm, nuôi dưỡng lông mượt và bóng, hiệu quả rõ rệt sau 1 tuần sữ dụng'),
(10008, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, chó, lược, lông', 'Đồ dùng cho chó', 'Lược inox chải lông ', 'https://salt.tikicdn.com/cache/200x200/ts/product/ee/a6/db/1d5a8b0462160804e9599e33d10fcc1c.jpg', 50, 79000, 'OEM', 'Hiệu quả, dễ sử dụng, chải thường xuyên giúp lông mềm mượt, tạo cảm giác dễ chịu và mang lại vẻ đẹp cho thú cưng'),
(10009, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, chó, mùi', 'Đồ dùng cho chó', 'Phấn khử mùi cho chó con Fay Puppy', 'https://salt.tikicdn.com/cache/200x200/ts/product/8b/ec/e2/c0c8d8704b5c304d218ace7b1686559f.jpg', 50, 40000, 'Fay', 'Fay Pupil là loại phấn khử mùi và làm khô sạch cho da lông thú bằng phương thức tắm khô, chuyên được dùng cho: Chó và mèo nhỏ, thường dễ bị bệnh khi tắm bằng nước. Các thú lớn đang trong thời gian bị bệnh. Làm sạch cho thú khi thời tiết lạnh.'),
(10010, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, kem, răng, chó, khô', 'Đồ dùng cho chó', 'Kem Đánh Răng Khô Cho Chó Budle\'Budle', 'https://salt.tikicdn.com/cache/200x200/ts/product/01/c5/15/353bbbeeaebfba67ddfccd7829e4bc9b.jpg', 50, 150000, 'Budle\'Budle', 'Chứa nha đam, vitamin B6, Chitosan. Loại bỏ mảng bám và sự hình thành vôi răng. Chống lại các chứng bệnh về nướu. Kiểm soát mùi hôi miệng'),
(10011, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, kìm, móng, chó, mèo', 'Đồ dùng cho chó', 'Kìm cắt móng chó mèo Pet Grooming Tools', 'https://salt.tikicdn.com/cache/200x200/ts/product/36/24/3f/7061be86a57c08eeee8610133cbc4cb3.jpg', 100, 45000, 'OEM', 'Chất liệu thép không gỉ chắc chắn. Giúp cắt tỉa móng thú cưng gọn gàng. Cắt được cho tất cả các loại móng của chó mèo. Sản phẩm giao màu ngẫu nhiên'),
(10012, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, sữa, chó, mèo, dầu', 'Đồ dùng cho chó', 'Sữa tắm tinh dầu Queen cao cấp dành cho chó mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/7a/be/89/a99188399ba287a82df290b53d363414.jpg', 100, 230000, 'Show Queen', 'Đúng như cái tên, đánh bật mọi sữa tắm về Độ thơm và Dưỡng lông . Sữa tắm Show Queen là sản phẩm sữa tắm nước hoa cao cấp giúp cho thú cưng trở nên xinh đẹp và quyến rũ hơn. Thành phẩn có chứa tinh dầu Marocco-argan giúp chăm sóc bề mặt da và lông thú hiệu quả.'),
(10013, 'Đồ dùng, chăm sóc, nhà, ngoài trời, gỗ, cửa, chó', 'Đồ dùng cho chó', 'Nhà gỗ ngoài trời có cửa dành cho chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/67/50/ff/8dc950c21751ea92b03ed129af812364.jpg', 100, 1525000, 'OEM', 'Chúng tôi tin rằng khi bạn chọn vào đây thì bạn hoặc người thân đang nuôi ít nhất một bé cún hoặc mèo con. Và có thể bạn chưa biết Nhà với chuồng là đồ dùng cho chó mèo không thể thiếu. Nhà gỗ chó mèo được làm từ chất liệu gỗ Plywood siêu bền, chắc chắn, có độ thẩm mỹ cao. Những chi tiết nhỏ tỉ mỉ và ngộ nghĩnh, giúp cho ngôi nhà trở nên đáng yêu hơn. Sản phẩm có nhiều kích thước phù hợp với Boss yêu của bạn'),
(10014, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, lược, ve, chấy, rận, chó', 'Đồ dùng cho chó', 'Lược Chải Ve Chấy Rận Cho Chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/6c/8b/f2/3e5b332d24f24cf1ca2d4ee222e047e1.jpg', 100, 55000, 'OEM', 'Thích hợp dùng cho cả thú cưng lông ngắn hay dài. Loại bỏ lông rụng bám trên người thú cưng. Loại bỏ lông rụng tối đa nhưng ko làm gãy rụng lông khỏe bên ngoài. Chất liệu tốt, chắc chắn, bền, không rỉ, chải sạch hết ve rận bám vào lông'),
(10015, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, sàn, nhựa, chó', 'Đồ dùng cho chó', 'Tấm nhựa dẻo lót sàn cho chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/c2/fb/f3/e5376ab502a5dea04d4a62812792bb96.jpg', 100, 22000, 'OEM', 'Tấm lót sàn làm từ nhựa dẻo cao cấp, mềm dẻo và đảm bảo an toàn khi sử dụng. Mắt lưới nhỏ, để các bạn chó mèo không bị lọt chân, phòng trừ những biểu hiện không tốt trong quá trình phát triển – ví dụ như tõe ngón, viêm da, hạ bàn…Nhưng vẫn đảm bảo lọt nước tiểu xuống dưới, giữ cho bề mặt tấm lót sàn luôn sạch sẽ, khô thoáng. Các tấm có khớp nối được với nhau, dễ dàng tháo gỡ & làm sạch.'),
(10016, ' Đồ chơi, bóng, chuột, chó', 'Đồ dùng cho chó', 'Đồ Chơi Bóng Chuột Cho Chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/13/93/33/ddb9657d26bfde3b23b23b8eb7f6ebdf.jpg', 100, 30000, 'OEM', 'Làm từ chất liệu an toàn giúp thú cưng hăng say chơi. Tạo sự vận động khỏe mạnh và nhanh nhẹn. Kiểu dáng và màu sắc đẹp, hấp dẫn thú cưng nhà bạn. Chất liệu bền, chắc chắn'),
(10017, 'Đồ dùng, chăm sóc, ăn, uống, chén, chó', 'Đồ dùng cho chó', 'Bộ Đôi Chén Ăn và Uống Cho Chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/c8/1c/6d/766741841e92367531819308501621eb.jpg', 100, 124000, 'OEM', 'Kích thước lòng chén 10cm. Kiểu dáng, mẫu mã dễ thương. Chất liệu an toàn cho thú cưng. Dùng được cho cả ăn và uống'),
(10018, 'Đồ dùng, chăm sóc,  uống, bình, nước, tự động, chó', 'Đồ dùng cho chó', 'Bình Nước Tự Động Cho Chó ', 'https://salt.tikicdn.com/cache/200x200/ts/product/9f/47/a2/b0155321d12212b825c483ca67bc825d.jpg', 100, 40000, 'OEM', 'Sản phẩm được thiết kế hiện đại. Tự động cấp nước cho chó mèo. Tự động cấp nước cho chó mèo. Rất tiện dụng khi bạn vắng nhà. Sản phẩm giao màu ngẫu nhiên'),
(10019, 'Đồ dùng, chăm sóc, dây, cổ, đi dạo, da, chó, mèo', 'Đồ dùng cho chó', 'Dây da cao cấp cho chó mèo GC', 'https://salt.tikicdn.com/cache/200x200/ts/product/67/59/57/80b6e2b88a261228e4f526b79063321b.jpg', 100, 75000, 'Kún Miu', 'Sản phẩm Dây da cao cấp cho chó mèo GC Kún Miu nổi bật lên với tông màu nâu đen nhã nhặn, cực \"sang chảnh\". Chất liệu hoàn toàn từ da cầm chắc tay, cùng với móc khóa và các chi tiết đính kèm là đồng nguyên chất. Móc khóa cực chắc chắn, thích hợp dùng với các giống chó nhỏ, lớn, chó trưởng thành. Bạn có thể thoải mái quản lý cún cưng trong các chuyến đi nhé.'),
(10020, 'Đồ dùng, chăm sóc,  ăn, uống, bát, kim loại, inox, chó, mèo', 'Đồ dùng cho chó', 'Bát Đơn Inox Cho Chó Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/fa/1f/b6/5543c0bf814dfe10bac9bf8df99e1403.jpg', 100, 85000, 'OEM', 'Sản phẩm Bát ăn inox cho chó mèo xứng đáng là sự lựa chọn lý tưởng của bạn dành cho thú cưng. Bề mặt trơn láng, dễ dàng chùi rửa sạch sẽ sau khi sử dụng. Được thiết kế đế cao, an toàn không sợ đổ hay trượt, sản phẩm phù hợp với các chú chó …'),
(10021, 'Đồ dùng, chăm sóc vệ sinh, nệm, nằm, tròn, chó, mèo', 'Đồ dùng cho chó', 'ổ nệm cho chó mèo hình tròn size lớn', 'https://salt.tikicdn.com/cache/200x200/ts/product/d4/74/af/065903b701a6f122527f43a598dc935e.PNG', 150, 300000, ' OEM', 'Ổ cho chó mèo size lớn 60x80x30cm ,ổ nệm cho thú cưng làm bằng vải nhung lông, dành cho cún 1 đến 70kg, trong xám ngoài đen'),
(10022, 'Đồ dùng, chăm sóc, nhà, gỗ, chó', 'Đồ dùng cho chó', 'Nhà Gỗ Độc Đáo Cho Chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/fa/a0/22/8f45215d5abe5bebac0f8e3f1bc5e98a.png', 150, 750000, 'OEM', 'Thích hợp cho các bé Cún nặng dưới 9kg. Chất liệu : Ván Plywood dày 15mm siêu bền, thẩm mỹ cao. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển. Nhà Boss mang phong cách hiện đại phù hợp với cả những căn hộ chung cư'),
(10023, 'Đồ dùng, huấn luyện, chuông, chó', 'Đồ dùng cho chó', 'Chuông huấn luyện cho chó', 'https://salt.tikicdn.com/cache/200x200/ts/product/52/63/90/3dbcf0f8f6aad17a3f4046cc4815984c.PNG', 150, 55000, 'OEM', 'Nhắc nhở tới giờ ăn. Xin đi vệ sinh, xin đi chơi hoặc dùng để chơi, nghịch ngợm'),
(10024, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, sữa, tắm, chó', 'Đồ dùng cho chó', 'Sữa tắm Yu Hoa Trà cho chó mèo 400ML', 'https://salt.tikicdn.com/cache/200x200/ts/product/41/97/9e/b6bf7758b376734b2544bcd9a79fe114.jpg', 150, 380000, 'OEM', 'Sữa tắm Yú là dòng sản phẩm chăm sóc lông chó, mèo độc đáo từ các loài hoa và thảo mộc phương Đông nâng niu làn da nhạy cảm, giúp bộ lông của thú cưng trở nên mềm mượt, đẫm hương thơm.'),
(10025, 'Đồ dùng, chăm sóc, vệ sinh, lông, tông đơ, chó, mèo', 'Đồ dùng cho chó', 'Tông đơ cao cấp Codos Cp-6800 cho chó mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/3c/89/fb/bfd07a69ddea51430bc0cc2c3a8938a0.jpg', 150, 400000, 'Codos', 'Chiếc tông đơ codos cp 6800 với động cơ mạnh mẽ, chạy cực êm sẽ không làm cún iu hoảng sợ. Lưỡi dao bằng sứ Titanium, sắc bén cắt rất “ngọt”, đảm bảo không có hiện tượng nhâm, ngậm lông, hoặc đứng máy khi gặp chùm lông dày. Chỉ trong 20 phút, chú cún của bạn sẽ được thay kiểu lông mới cực xinh xắn.'),
(10026, 'Đồ dùng, rọ mõm, kim loại, inox, chó', 'Đồ dùng cho chó', 'Rọ mõm cho chó -chất liệu inox không gỉ', 'https://salt.tikicdn.com/cache/200x200/ts/product/8c/aa/da/01bca2ee82d1329922d49eb16b9af96e.png', 150, 95000, 'SUNZIN', 'Rọ mõm chó inox - chó 7-12kg (size tiểu ) hanpet 375e. chất liệu 100% inox cực kỳ chắc chắn, không gỉ, dây đai rất dai bền, chắc, có thể điều chỉnh kích thước, có tấm nệm hầu, giúp chó đeo lâu không bị hằn cổ'),
(10027, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, lông, tai, bột, chó, mèo', 'Đồ dùng cho chó', 'Bột Nhổ Lông Tai Cho Chó Mèo Petis Ear Powder', 'https://salt.tikicdn.com/cache/200x200/ts/product/e9/02/bc/10e1992c53b8ac97c00ccd5c4ff7042e.jpg', 150, 65000, 'OEM', 'Đặc điểm quan trọng nhất của bột nhổ lông tai cho chó mèo - Petis Ear Powder là có thể giảm đau giảm ngứa khi nhổ lông tai của chúng, để chú chó của bạn không thấy cảm giác đau sẽ không kháng cự khi nhổ lông tai chúng, và chúng ta hoàn toàn có thể thoải mái làm điều đó.'),
(10028, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, cổ, vòng, ve, rận, chó', 'Đồ dùng cho chó', 'Vòng cổ trị ve rận cho chó lớn', 'https://salt.tikicdn.com/cache/200x200/ts/product/35/78/4b/44f2aeee54942f54d210c29f2cb3f6b5.jpg', 150, 70000, 'OEM', 'Vòng cổ trị ve rận cho chó 4 in 1 là sản phẩm đeo cho chó để đuổi và diệt ve rận với công hiệu bảo vệ lâu dài, 4 hiệu quả trong 1. Sử dụng thuận tiện, đeo trên cổ là có thể đuổi bọ diệt bọ: Công thức diệt bọ không độc, sử dụng chất chế từ thiên nhiên. Trong quá trình chó con đeo trên cổ, trực tiếp phát huy công dụng, nhanh chóng tiêu diệt bọ chét, rệp, rận, ve,.. xâm phạm cơ thể.'),
