(10047, 'Đồ ăn, chăm sóc, sức khỏe, thực phẩm chức năng, chó', 'Đồ ăn cho chó', 'Thức Ăn Chó Trưởng Thành Giống Nhỏ Chống Chảy Nước Mắt Và Viêm Da (Từ 10 Tháng) Fitmin Mini 400G', 'https://salt.tikicdn.com/cache/200x200/ts/product/e5/ca/46/5ab6ad7dde8de21191364e6870d1b52d.jpg', 200, 65000, 'Fitmin ', 'Thức Ăn Chó Trưởng Thành Giống Nhỏ Chống Chảy Nước Mắt & Viêm Da (Từ 10 Tháng) Fitmin Mini 400G làm từ thịt tươi giàu chất dinh dưỡng và tốt cho sức khỏe. Không lúa mạch giảm nguy cơ kích ứng lợi khuẩn tăng cường vi khuẩn có lợi. Không chứa Gmo (Thành phần biến đổi gen) Chất chống oxy hóa tự nhiên. Chăm sóc răng cho hàm răng khỏe mạnh Chiết xuất cây hương thảo hỗ trợ gan và tiêu hóa. Tinh chất cây ngọc giá giúp giảm mùi hôi và nước tiểu'),
