(10099, 'Đồ ăn, chăm sóc, sức khỏe, thực phẩm chức năng, mèo, cá', 'Đồ ăn cho mèo', 'Thức Ăn Cho Mèo Temptations Hương Cá Ngừ 85g', 'https://salt.tikicdn.com/cache/200x200/ts/product/34/d6/19/98e30a217c94e670953cb554477423e5.jpg', 300, 47000, 'Temptations', '100% dinh dưỡng cho mèo trưởng thành Là dòng bánh thưởng ít calo, vỏ ngoài giòn tan Bên trong mềm và sệt sẽ khiến mèo rất thích thú');
