(10122, 'Đồ ăn, chăm sóc, sức khỏe, thực phẩm chức năng, mèo, súp', 'Đồ ăn cho mèo', 'Súp hải sản dinh dưỡng cho mèo 250gr (Dạng pudding tiện cho mèo liếm láp)', 'https://salt.tikicdn.com/cache/200x200/ts/product/8a/74/53/d57bb40d02db3b3f67e8bf1061aa5663.jpg', 400, 100000, 'OEM', 'Được làm từ các loại hải sản thơm ngon nhất (cá biển, cá hồi, sò điệp, bào ngư v.v.) kích thích sự thèm ăn của mèo yêu. Sản phẩm có dạng bánh pudding, mèo yêu có thể liếm láp bữa ăn ngon lành một cách tự nhiên theo thói quen của mèo.'),
(10123, 'Đồ dùng, chăm sóc, vệ sinh,cát, mèo', 'Đồ dùng cho mèo', 'Cát Ấn Độ cho mèo (Hương Baby Powder) INDHONG', 'https://salt.tikicdn.com/cache/200x200/ts/product/7d/15/a1/97f2670eb618dfda608d695aa576a791.jpg', 400, 120000, 'OEM', 'Cát vệ sinh mèo Indian, 7.5Kg /gói. Kích thước hạt từ 0.5mm đến 2.5mm. Hương Baby Powder (Phấn em bé). Hút ẩm tốt. Kháng khuẩn bảo vệ da mèo. Vón cục - Tách lớp nhanh. Thỏa mãn bản năng của mèo. Hoàn toàn khô ráo.'),
(10124, 'Đồ dùng, chăm sóc, vệ sinh,cát, mèo', 'Đồ dùng cho mèo', 'Cát Ấn Độ cho mèo (Hương Lavender) IND - Tím', 'https://salt.tikicdn.com/cache/200x200/ts/product/f3/f9/65/0a1a04378d433d08b4989412105167ca.jpg', 400, 120000, 'OEM', 'Cát vệ sinh mèo Indian, 7.5Kg /gói. Kích thước hạt từ 0.5mm đến 2.5mm. Hương Baby Powder (Phấn em bé). Hút ẩm tốt. Kháng khuẩn bảo vệ da mèo. Vón cục - Tách lớp nhanh. Thỏa mãn bản năng của mèo. Hoàn toàn khô ráo.'),
(10125, 'Đồ dùng, chăm sóc, vệ sinh, nhà, mèo', 'Đồ dùng cho mèo', 'Nhà Vệ Sinh Cho Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/66/1a/e6/59d9a609798e3cc7ae6048026460166e.jpg', 400, 305000, 'OEM', 'Thiết kế thông minh giúp giữ vệ sinh nơi ở, không làm cát bị bới tung tóe khắp nơi khi mèo đi vệ sinh. Trên thân nắp có kèm gói sợi than làm khử mùi hôi của nước tiểu mèo, tặng kèm xẻng vệ sinh mèo. Kiểu dáng nhẹ gọn có tay cầm dễ dàng di chuyển, có thể tháo rời ra khi không sử dụng, tiết kiệm diện tích. Được làm bằng nhựa cao cấp, màu sắc tươi tắn dễ thương'),
(10126, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, sữa, tắm, mèo', 'Đồ dùng cho mèo', 'Sữa Tắm Dành Cho Mèo SOS (530ml)', 'https://salt.tikicdn.com/cache/200x200/ts/product/ae/b1/d6/042fe8da54b8d8695002e89df07625cf.jpg', 400, 79000, 'SOS', 'Thành phần an toàn cho thú cưng. Khử mùi hôi trên chó mèo hiệu quả. Chăm sóc bộ lông cho thú cưng'),
(10127, 'Đồ dùng, chăm sóc, vệ sinh, nhà, mèo', 'Đồ dùng cho mèo', 'Nhà Vệ Sinh Cho Mèo Khổ Lớn', 'https://salt.tikicdn.com/cache/200x200/ts/product/fc/b0/1b/0b73765629833fb8677e9f925636a5db.jpg', 400, 340000, 'OEM', 'Sen e ngại Boss khi đi vệ sinh cát sẽ văng ra ngoài thì dùng dòng này nhé. SP đảm bảo nhà bạn sạch sẽ không văng cát. Có sẵn xẻng vệ sinh, có nhiều màu để lựa chọn: xanh, nâu, hồng, tím'),
(10128, 'Đồ ăn, chăm sóc, sức khỏe,  sữa, mèo', 'Đồ ăn cho mèo', 'Sữa Cho Mèo KMR Petag USA (340g)', 'https://salt.tikicdn.com/cache/200x200/ts/product/7b/69/c4/1adc32c6ca32edbe4e57f5f79ca8ab63.jpg', 400, 575000, 'PetAg', 'Các công thức chế biến sữa hoàn toàn tự nhiên. Cung cấp đầy đủ các chất dinh dưỡng phù hợp cho mèo. Bổ sung nhiều Vitamin và khoáng chất'),
(10129, 'Đồ dùng, chăm sóc, vệ sinh, cát, mèo', 'Đồ dùng cho mèo', 'Cát Vệ Sinh Cho Mèo Me-O Hương Chanh (10L)', 'https://salt.tikicdn.com/cache/200x200/ts/product/37/2c/57/141d0029266f4d5cbe893599fa5e413c.jpg', 400, 194000, 'Me-O', 'Sản xuất từ nguyên liệu tự nhiên an toàn cho bạn và thú cưng. Kiểm soát hiệu quả các mùi khó chịu. Thấm hút cực tốt, nhanh chóng vón cục phân và nước tiểu của mèo. Giảm thiểu lượng rác bẩn cần dọn dẹp'),
(10130, 'Đồ dùng, chăm sóc, vệ sinh, cát, mèo', 'Đồ dùng cho mèo', 'Cát thủy tinh cho mèo Kit Cat 5L - Crystal', 'https://salt.tikicdn.com/cache/200x200/ts/product/09/61/d2/d7ac2c7cef86c5de9c75d58dd1fc7285.jpg', 400, 140000, 'OEM', 'Hạt Silicon Dioxide với khả năng thấm hút đến 80% chất lỏng và khả năng khử mùi diệt khuẩn cao theo công nghệ Silic từ Singapore, cát Thủy Tinh KitCat tuyệt đối là dòng cát vệ sinh hiệu quả và tiết kiệm cho chủ nuôi mèo. Với đa dạng mùi hương từ hương trái cây đến hương hoa cỏ, khách hàng và mèo có thể thử mùi hương khác nhau để chọn ra loại hương yêu thích, mà khay cát và khu vực mèo sinh sống vẫn luôn sạch sẽ thơm tho. Bao bì cát có thể tích 5L - các chủ nuôi dễ dàng sử dụng và bảo quản cát thủy tinh, cũng như di chuyển nhanh chóng. Thiết kế bao bì của KitCat luôn hướng đến sự trẻ trung, năng động và nổi bật. Bao bì cát thủy tinh có chỗ nắm tay cầm trên bao bì giúp người sử dụng cầm nắm và sử dụng cát tiện lợi hơn.'),
(10131, 'Đồ dùng, chăm sóc, vệ sinh, cát, khay, xẻng, mèo', 'Đồ dùng cho mèo', 'Khay đựng cát vệ sinh cho mèo tặng kèm xẻng ', 'https://salt.tikicdn.com/cache/200x200/ts/product/13/10/19/18c098834b9f8ecb21f4920e21809e11.jpg', 400, 80000, 'OEM', 'Khay đựng cát vệ sinh cho mèo được làm bằng chất nhựa đẹp, dày dặn, có nắp vòm bao xung quanh khay giúp hạn chế cát văng ra ngoài khi mèo hất cát, nắp vòm này có thể gỡ ra để dễ vệ sinh hơn. Khay được thiết kế theo tỉ lệ hợp lí để không bị lật khi mèo đứng lên. Màu sắc lại rất đa dạng tha hồ lựa chọn nè. Thay vì chọn đại 1 cái thau chậu đựng cát hãy sử dụng 1 khay vệ sinh chuyên dụng cho mèo để cả mèo và bạn chủ đều cảm thấy thoải mái khi nhắc đến vấn đề vệ sinh cho mèo.'),
(10132, 'Đồ dùng, chăm sóc, vệ sinh, sỏi, chất thải, mèo', 'Đồ dùng cho mèo', 'Sỏi hút chất thải cho mèo Mon Ami Hygiene 5L', 'https://salt.tikicdn.com/cache/200x200/ts/product/f6/0c/ad/abef3009ec9ba8c75f9864b4d35f5e74.jpg', 400, 90000, 'OEM', 'Hạn chế mùi hôi tuyệt đối. Độ thấm hút cao. Không độc hại. Không có bụi. Dễ vốn cục. Dễ hốt'),
(10133, 'Đồ dùng, chăm sóc, vệ sinh, cát, mèo', 'Đồ dùng cho mèo', 'Cát vệ sinh cho mèo Kún Miu Carbon Coffee hạt tròn (8L)', 'https://salt.tikicdn.com/cache/200x200/ts/product/b6/16/8e/567b577f091838249597e9b9ccf0a87a.jpg', 400, 84000, 'Kún Miu', 'Kết dính nhanh, độ vón tốt, dễ dàng xúc bỏ. Khử mùi hiệu quả, chống ẩm, mùi hương dễ chịu. Giảm 99,9% bụi, an toàn sử dụng với người và thú cưng. Sản phẩm sạch có nguồn gốc thiên nhiên, thân thiện với môi trường. Cát hạt tròn'),
(10134, 'Đồ dùng, chăm sóc, vệ sinh, nhà, mèo, cửa', 'Đồ dùng cho mèo', 'Nhà vệ sinh siêu to có cửa cho mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/76/83/c1/b44a5805799e1dc43d196beea52706c6.jpg', 400, 300000, 'OEM', 'Mèo là loài động vật rất sạch sẽ và chúng vô cùng khó chịu khi bị ai đó thấy hoặc quấy rầy trong lúc đang đi vệ sinh. Chỉ sau vài lần bị ai đó dòm ngó, chúng sẽ đổi chổ và bắt đầu \" hành xử \" ở những nơi khuất như dưới gầm giường, gầm tủ... Việc đó sẽ khiến bạn phát điên lên vì rất khó vệ sinh ở những góc khuất như vậy. Do đó Nhà Vệ Sinh Cho Mèo có thiết kế hình hộp và có cửa che vô cùng thích hợp với thói quen đi vệ sinh của loài mèo.'),
(10135, 'Đồ dùng, chăm sóc, vệ sinh, bột, khử mùi, mèo, bột', 'Đồ dùng cho mèo', 'Bột Litter Box Deodorizer 100g khử mùi tăng vón cho cát vệ sinh mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/db/4a/bd/7d94f46c4fb49d6265445ec14441b09c.jpg', 400, 90000, 'OEM', 'Khi bạn đã đổi qua nhiều loại cát mà vẫn chưa thể ưng ý được chất lược cát về độ vón và độ khử mùi của cát mình đang dùng. Vậy bạn hãy thử dùng sản phẩm Bột Litter Box Deodorizer 100g Hỗ trợ tăng độ vón, độ hút mùi của cát vệ sinh giúp căn phòng của bạn luôn thơm tho. loại bỏ tối đa mùi khó chịu cũng như tiết kiệm đáng kể lượng cát bị hỏng do hết vón.'),
(10136, 'Đồ dùng, chăm sóc, vệ sinh, nhà, mèo, xẻng', 'Đồ dùng cho mèo', 'Nhà vệ sinh cao cấp cho mèo hình tàu du hành vũ trụ (Kèm xẻng)', 'https://salt.tikicdn.com/cache/200x200/ts/product/25/64/e5/e459b89b43efe19ac1359e747c5e5720.jpg', 400, 1450000, 'OEM', 'Nhìn về kiểu dáng thiết kế thì nhà vệ sinh này khá hiện đại và tạo được môi trường riêng cho mèo khi đi vệ sinh, nó giống như một chiếc nhà hoàn hảo. Nhà vệ sinh này vô cùng chắc chắn và bền đẹp nên bạn có thể hoàn toàn yên tâm về chất lượng dịch vụ nhé. Phần đế bên dưới để chứa đựng phân của mèo dễ tháo lắp để rửa, vệ sinh khiến cho sản phẩm luôn được sạch sẽ không phát mùi ra không gian xung quanh. Bên trong còn có hệ thống khử mùi hoàn hảo bạn có thể yên tâm nếu quên không vệ sinh cho mèo thì cũng sẽ không gây mùi ra ngoài nhé. Phía trước còn có 1 chiếc cửa trong suốt mèo ta có thể nhìn ra ngoài hay bạn có thể theo dõi các hoạt động bên trong của chúng.'),
(10137, 'Đồ dùng, chăm sóc, vệ sinh, nhà, mèo, khay', 'Đồ dùng cho mèo', 'Nhà vệ sinh cao cấp cho mèo Loại có nơ và khay cát dạng Ngăn kéo - Maklar cat box', 'https://salt.tikicdn.com/cache/200x200/ts/product/d0/52/22/fe38cc5d80cb2f81954f3f09a2d1b09f.jpg', 400, 650000, 'OEM', 'Nắp trên cùng của nhà vệ sinh thiết kế thuận tiện để đặt xẻng cát, túi đựng hoặc các phụ kiện nhỏ khác. Tay cầm thuận tiện để có thể di chuyển Khóa an toàn giúp khay cát cố định trong khi di chuyển. Khay ngăn kéo tiện lợi để dọn cát mèo.'),
(10138, 'Đồ dùng, chăm sóc, đồ chơi, massage, móng, cào, mèo', 'Đồ dùng cho mèo', 'Đồ Chơi Massage Cào Móng Cho Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/89/6b/d2/b0d18b1e414d692394fa95cea3776e55.jpg', 400, 140000, 'OEM', 'Đơn giản, nhỏ gọn với thiết kế thông minh, đồ chơi thư giãn cho mèo được tạo nên từ nhựa PVC kèm len, sợi ở phần đế tạo cảm giác mềm mại, thư giãn đích thực cho mèo cưng. Đặc biệt: nhựa có có tác dụng giúp chú mèo cọ xát, chải lông, làm mượt lông và mát xa dưới da.'),
(10139, 'Đồ dùng, hóa trang, nón, sừng, mèo', 'Đồ dùng cho mèo', 'Nón sừng quỷ hóa trang', 'https://salt.tikicdn.com/cache/200x200/ts/product/ff/f3/b2/761db6098de9568ea92f0ac4a632ba2e.jpg', 400, 70000, 'xudapet', 'Chất liệu: nhung mềm Kích thước : Size S : dây thun co giãn: 11-19cm, sừng cao 6cm Size L: dây thun co giãn: 20-40 cm, sừng cao : 11cm. Màu sắc: đỏ , đen. Thun đeo cổ có thể điều chỉnh co giãn tùy bé. Sừng quỷ đồ hóa trang Halloween có chất vải mềm mại, thoải mái. Chó mèo nhà bạn vẫn được sừng giữ cố định ở 2 bên tai khi di chuyển .'),
(10140, 'Đồ dùng, chăm sóc, sức khỏe, nệm, giữ ấm, chó, mèo', 'Đồ dùng cho mèo', 'Nệm giữ ấm cho Chó Mèo- Hình Tai Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/ca/00/7e/60a62d45a3ec9ee7b19a9e7fe109f4b9.jpeg', 400, 145000, 'OEM', 'Một khi con vật cưng yêu của bạn có \"lãnh thổ\" của riêng \"\", việc giữ cho ngôi nhà của bạn gọn gàng và sạch sẽ sẽ không còn là một giấc mơ nữa. Với hai họa tiết hoa văn bắt mắt thú cưng cho bạn lựa chọn, tạo cảm giác ấm áp cho thú cưng dù là mùa đông hay mùa hè. Sản phẩm luôn làm hài lòng những thú cưng \"khó chiều\" :3'),
(10141, 'Đồ dùng, chăm sóc, sức khỏe, giường, võng, mèo', 'Đồ dùng cho mèo', 'Giường Võng Xinh Xắn Cho Mèo #CT005', 'https://salt.tikicdn.com/cache/200x200/ts/product/66/65/5b/8d90985e2d0837ef82e61d366d5e4f05.png', 400, 800000, 'OEM', 'Kích thước: D40 x R35 x C60 cm. Phù hợp với bé mèo có cân nặng <7kg. Chất liệu: gỗ Plywood siêu bền dày 15mm, rất chắc chắn, có thẩm mỹ cao. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển'),
(10142, 'Đồ dùng, chăm sóc, balo, mèo', 'Đồ dùng cho mèo', 'Balo Phi Hành Gia Trong Suốt Cho Chó Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/11/01/f6/118b7246df3a449e60720cff93c0b6cf.png', 400, 240000, 'OEM', 'Có mặt kính tròn trong suốt giúp thú cưng có thể ngắm nhìn đường phố khi đi chơi. Có nhiều lỗ thông khí xung quanh khắp balo giúp thú cưng thông thoáng.  Vai đeo lót nệm êm ái.'),
(10143, 'Đồ dùng, chăm sóc, cỏ, lông ,mèo', 'Đồ dùng cho mèo', 'Bộ trồng cỏ tiêu búi lông cho mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/1c/a8/36/156225bea7d8f1b1ec465cccfe589346.jpg', 400, 44000, 'OEM', 'Cải thiện chất xơ thực vật để kích thích tiêu hóa và nâng cao sức đề kháng của dạ dày. Xử lý bệnh hairballs (búi lông cục trong ruột mèo). Làm tăng khả năng kích thích sữa cho mèo mẹ đang mang thai và cho con bú. Giúp bé mèo giảmhôi miệng, phòng ngừa các bệnh như hôi miệng, răng nướu. Hơn nữa còn bổ sung rất nhiều Vitamin hữu ích cùng nguyên tố vi lượng có tác dụng làm giảm thể viêm nướu.'),
(10144, 'Đồ dùng, chăm sóc, đồ chơi, móng, cào, mèo', 'Đồ dùng cho mèo', 'Bàn Cào Móng Độc Đáo Cho Mèo #CT001', 'https://salt.tikicdn.com/cache/200x200/ts/product/4e/c4/14/7356d3d6876a72cacc112fd5775d6c09.png', 400, 500000, 'OEM', 'Kích thước: D40 x R35 x C60 cm. Phù hợp với bé mèo có cân nặng <7kg. Chất liệu: gỗ Plywood siêu bền dày 15mm, rất chắc chắn, có thẩm mỹ cao. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển'),
(10145, 'Đồ dùng, chăm sóc, sức khỏe, nệm, chó, mèo', 'Đồ dùng cho mèo', 'Nệm ngủ cho chó mèo - Mặt ngoài vải dù không thấm nước (Giao màu ngẫu nhiên)', 'https://salt.tikicdn.com/cache/200x200/ts/product/18/4e/83/7c6f6dd5e3c3f6c2b318af6651a45c2c.jpg', 400, 270000, 'OEM', 'Nệm ngủ cho chó mèo được thiết kế để cho thú cưng của bạn có một giấc ngủ ngọt ngào. Mặt trong nệm ngủ được làm từ vải nhung ấm áp và mềm mại, nên thú cưng của bạn sẽ cảm thấy thoải mái khi trong đó. Mặt ngoài nệm ngủ được làm từ vải dù, không thấm nước. Ruột được làm từ bông gòn siêu êm, tạo cảm giác thoải mái cho thú cưng. Dễ dàng vệ sinh, giặt giũ. Đường may tỉ mĩ và chắc chắn'),
(10146, 'Đồ dùng, chăm sóc, đồ chơi, móng, cào, mèo, trụ', 'Đồ dùng cho mèo', 'Đồ chơi trụ cào móng 2 tầng cho mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/a9/18/97/7540ecd91d723b436289977e1ff11ce2.jpg', 400, 230000, 'OEM', 'Cat tree - nhà cây, hay còn gọi là cat stand, cat condo, có thể hiểu như một ngôi nhà, một sân chơi, một phòng tập thể hình dành cho Mèo yêu tận hưởng những giây phút thư giãn, giải trí.'),
(10147, 'Đồ dùng, chăm sóc, đồ chơi, kim loại, mèo, thép, lông', 'Đồ dùng cho mèo', 'Đồ chơi cần câu mèo bằng thép gắn lông dành cho mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/ff/87/01/473709e75cd6979faee3bf201dcbbee1.jpg', 450, 13000, 'OEM', 'Đồ chơi cho mèo cần câu mèo có tác dụng kích thích vận động ở mèo, giúp chúng giải tỏa căng thẳng, mệt mỏi, từ đó giúp phát triển sức khỏe cũng như não bộ. Đối với những chú mèo nghịch ngợm thì swing cat còn có sức hút kéo chúng khỏi việc cào cắn đồ đạc trong nhà'),
(10148, 'Đồ dùng, chăm sóc,đồ chơi, chó, mèo', 'Đồ dùng cho mèo', 'Combo 3 chuột mini đồ chơi cho chó mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/b3/60/4d/c79639828263727401dfffa2f94d94eb.PNG', 450, 32000, 'OEM', 'Đồ chơi cho mèo vờn giúp mèo thích thú, vui vẻ.  Có thể chọc bé cún. Chuột mini có nhiều màu'),
(10149, 'Đồ dùng, chăm sóc, đồ chơi, móng, cào, mèo, trụ', 'Đồ dùng cho mèo', 'Đồ chơi trụ cào cây cà rốt cho mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/be/54/e7/b6a8fcb8af53997d5cf07e1323ea04df.jpg', 450, 230000, 'OEM', 'Cải thiện sức khỏe của mèo: Trụ cào cây cà rốt là một món đồ chơi thú vị cho mèo. Giúp ngăn mèo khỏi trầy xước và giảm stress. Mèo tha hồ cào móng và vờn cà rốt cả ngày không chán. Nguyên vật liệu tự nhiên: Trụ cào này chủ yếu được làm bằng dây rơm tự nhiên và salu. Bạn có thể ngửi thấy mùi tự nhiên, nó tuyệt đối an toàn cho người và vật nuôi, và mèo con của bạn sẽ thích nó.'),
(10150, 'Đồ dùng, chăm sóc, sức khỏe, cỏ, catnip, khô, mèo, bạc hà', 'Đồ dùng cho mèo', 'Catnip Ống Khô Cho Mèo - Bạc Hà Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/1a/1c/e0/31b67ca8d51888b85cb825ef7192a10f.jpg', 450, 30000, 'Kún Miu', 'Catnip khô cho mèo (CATNIP, CATMINT) có tác dụng thư giãn với họ nhà mèo. Là đồ chơi cho mèo thư giã, giúp mèo thư giãn'),
(10151, 'Đồ dùng, chăm sóc, đồ chơi, móng, cào, mèo', 'Đồ dùng cho mèo', 'Cào móng hình chữ nhật cho mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/15/5b/f7/6da6252b1c85c1d9ff644e155baaf659.jpg', 450, 45000, 'OEM', 'Thiết kế nhỏ gọn, dễ sử dụng, phù hợp với mọi loại mèo'),
(10152, 'Đồ dùng, chăm sóc,  đồ chơi, snack, mèo', 'Đồ dùng cho mèo', 'Đồ Chơi Hộp Đựng Snack Shaking Q Pet Cho Mèo - Nhập khẩu Hàn Quốc', 'https://salt.tikicdn.com/cache/200x200/ts/product/67/9a/b6/dc8e63bb7d16b49498b3fca6078f5d46.jpg', 450, 83000, 'RoyalCanin', 'Đồ chơi giúp thú cưng nhà bạn không cảm thấy buồn chán, cô đơn khi phải ở nhà một mình. Cấu tạo của đồ chơi có thể cho thức ăn vào trong, tạo cảm giác kích thích sự tìm kiếm thức ăn của thú cưng nhà bạn; đồng thời giúp chúng học được cách trân trọng đồ ăn. Bạn sẽ yên tâm khi để thú cưng ở nhà một mình với đồ chơi con lật đật, vì thú cưng nhà bạn sẽ cảm thấy vui vẻ và yêu đời hơn. Vật liệu nhựa an toàn với sức khỏe thú cưng của bạn.'),
(10153, 'Đồ dùng, chăm sóc, đồ chơi, đĩa bay, mèo', 'Đồ dùng cho mèo', 'Đồ chơi đĩa bay CattyMan dành cho Mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/70/93/b3/93577f71f79de6254744b7e87be1667d.jpg', 450, 180000, 'CattyMan', 'Sản phẩm từ gỗ tự nhiên với bột silvervine giúp tạo hưng phấn cho mèo. Banh nhiều màu sắc xoay vòng thu hút. Thanh gỗ đàn hồi có chuông tạo tiếng động.'),
(10154, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, đồ chơi, sữa, kẹo mút, catnip, mèo', 'Đồ dùng cho mèo', 'Đồ Chơi Kẹo Mút Catnip Cho Mèo - Cera Pet Home', 'https://salt.tikicdn.com/cache/200x200/ts/product/56/49/a2/bbaff865cd04b2ca0002576015114b1c.jpg', 450, 45000, 'CeRa Pet Home', 'Hổ trợ chống búi lông, lợi tiêu hóa. Giúp mèo thư giãn khi chủ vắng nhà. Làm sạch răng nứu'),
(10155, 'Đồ dùng, chăm sóc, sức khỏe, đồ chơi, móng, cào, mèo, trụ', 'Đồ dùng cho mèo', 'Trụ cào cho mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/d5/87/a7/ef6c8b4d6b659106933b1799d69c889f.jpg', 450, 280000, 'OEM', 'Mèo sẽ tha hồ cào móng, dành cho mèo chơi đùa, xã stress. Thiết kế đẹp mắt, chất liệu bền chắc theo tiêu chuẩn Nhật Bản. Chất liệu : Giấy , MDF, dây đay ,polyester'),
(10156, 'Đồ dùng, chăm sóc,gỗ, đồ chơi, thang, tường, mèo', 'Đồ dùng cho mèo', 'Thang Treo Tường Cho Mèo #CT002', 'https://salt.tikicdn.com/cache/200x200/ts/product/7e/dc/c6/af7504d7ea601600e25070ff216579f1.jpeg', 450, 500000, 'OEM', 'Kích thước: D20 x R35 x C55 cm. Phù hợp với bé cưng có cân nặng <7kg. Chất liệu: Gỗ Plywood siêu bền dày 15mm, rất chắc chắn, có thẩm mỹ cao. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển. Thang trèo mang phong cách sang trọng hiện đại phù hợp ngay với cả những căn hộ chung cư'),
(10157, 'Đồ dùng, chăm sóc, nhà, đồ chơi, mèo, trụ', 'Đồ dùng cho mèo', 'Trụ mèo 4 tầng cao 1,4m nhiều bộ phận nhà cây cho mèo cào ', 'https://salt.tikicdn.com/cache/200x200/ts/product/98/09/e1/d5e55b0e9858d6e9e5691936b6d9f104.png', 450, 1190000, 'Hanpet', 'Hãy đầu tư một dụng cụ thích hợp để hướng cho chú mèo của bạn cào móng đúng chỗ. Chọn một dụng cụ cào móng với bề mặt thô nhám để mèo của bạn có thể cào và làm sắc đẹp bộ móng bằng tất cả những sự thích thú của nó. Một dụng cụ cào móng được làm từ sợi thừng đay là một lựa chọn rất hoàn hảo và quả cho mèo cào móng'),
(10158, 'Đồ dùng, chăm sóc, đồ chơi, mèo, cá, bông', 'Đồ dùng cho mèo', 'Đồ Chơi Cá Thu Nhồi Bông Cho Thú Cưng', 'https://salt.tikicdn.com/cache/200x200/ts/product/6e/f1/52/15f0f21910c6d16a5bd4455892651b67.jpg', 450, 49000, 'OEM', 'Chất liệu từ vải và bông tuyệt đối an toàn cho mèo. Mang lại thời gian vui vẻ cho bạn và thú cưng. Tăng cường khả năng vận động hoạt bát của thú cưng.'),
(10159, 'Đồ dùng, chăm sóc, đồ chơi, cần câu, chuông, mèo, cần câu, nhựa', 'Đồ dùng cho mèo', 'Cần câu cho mèo cán nhựa có lông và chuông - Màu ngẫu nhiên', 'https://salt.tikicdn.com/cache/200x200/ts/product/e1/52/5e/43c45fcb540dfbc20c1715092d88898d.jpeg', 450, 28000, 'OEM', 'Làm từ chất liệu an toàn giúp thú cưng hăng say chơi. Tạo sự vận động khỏe mạnh và nhanh nhẹn. Kiểu dáng và màu sắc đẹp, hấp dẫn thú cưng nhà bạn. Chất liệu bền, chắc chắn. Cải thiện tình cảm giữa bạn và con vật cưng của bạn'),
(10160, 'Đồ dùng, chăm sóc, vệ sinh, sữa, tắm, mèo, lông', 'Đồ dùng cho mèo', 'Sữa Tắm Cho Mèo Lông Ngắn Lee & Webster (280ml)', 'https://salt.tikicdn.com/cache/200x200/ts/product/5e/63/d7/d7ab2e9d3bedfc74f23d8ac8c3a00e73.jpg', 450, 205000, 'Lee & Webster', 'Dùng để tắm chó và mèo. Làm sạch và chống oxy hoá. Duy trì màu trắng tinh khiết cho bộ lông. Ngăn ngừa sự biến đổi màu của lông'),
(10161, 'Đồ ăn, chăm sóc, sức khỏe, vẹt, chim', 'Đồ ăn cho chim', 'Đồ ăn cho Vẹt tăng tràn đầy năng lượng và giọng hót SmartHeart (100g)', 'https://salt.tikicdn.com/cache/200x200/ts/product/38/27/ec/f59a3508798cec67c13178d554266bf4.jpg', 450, 28000, 'SmartHeart', 'Thức ăn được thiết kế riêng dành cho chim cảnh, chim hót. Gừng giúp làm dịu các cơ quan âm thanh, thúc đẩy sức khỏe đường hô hấp và hệ tiêu hóa'),
(10162, 'Đồ dùng, chăm sóc, sức khỏe, chim, cân, điện tử, chim', 'Đồ dùng cho chim', 'Cân điện tử cho thú cưng nhỏ Redmon Digital Pet & Bird Scale, White', 'https://www.vietpet.net/wp-content/uploads/2019/12/can-dien-tu-cho-thu-cung-nho-redmon-digital-pet-bird-scale-white.jpg', 450, 55000, 'Redmon', 'Quy mô vật nuôi đáng tin cậy được thiết kế để cân động vật nhỏ, chim và thức ăn.\r\nCó thiết kế hiện đại, đẹp mắt với nền tảng bằng kính.\r\nCác biện pháp đọc kỹ thuật số tính bằng gam hoặc ounce với gia số 1 ounce.'),
(10163, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn vẹt Lorikeet & Honeyeater 300g', 'https://salt.tikicdn.com/cache/200x200/ts/product/fd/7e/5e/cc65cc43e10e2d97f3c057a74a86a660.jpg', 450, 530000, 'OEM', 'Thức ăn Lorikeet & Honeyeater 300g dạng bột dùng để pha với nước cho các loài chim ăn mặt và Lori. Hoà tan 300g bột thức ăn với 500ml nước nóng, trộn đều và thêm nước lọc cho đến khi đủ 1 lít. Thức ăn đã pha có thể bảo quản lạnh'),
(10164, 'Đồ dùng, chăm sóc, sức khỏe, chim, khay, lồng, vẹt, chim', 'Đồ dùng cho chim', 'Khay thức ăn treo lồng cho vẹt', 'https://salt.tikicdn.com/cache/200x200/ts/product/e5/20/84/4f9c4cfd6d7feefadcae2901a6bf5635.jpg', 450, 95000, 'OEM', 'Khay đựng thức ăn treo lồng cho vẹt. Chất liệu nhựa cao cấp. An toàn khi sử dụng'),
