(10166, 'Đồ dùng, chăm sóc,gỗ, cầu thang, đồ chơi, vẹt, chim', 'Đồ dùng cho chim', 'Đồ chơi vẹt cầu thang gỗ treo lớn 2', 'https://salt.tikicdn.com/cache/200x200/ts/product/59/f1/bd/033dec04fb1d93fb80a24cde45b42ebe.jpg', 450, 60000, 'OEM', 'Đồ chơi vẹt cầu thang gỗ tre, được làm bằng gỗ tẩm màu thực phẩm, rất an toàn cho vẹt'),
(10167, 'thuốc, chăm sóc, sức khỏe, vệ sinh, vẹt, chim', 'Thuốc thú y', 'Dung dịch trị bệnh cho vẹt cảnh - Enrotril 100ml', 'https://salt.tikicdn.com/cache/200x200/ts/product/d4/17/f3/a023dc4fcbc91a245a8e9439cc2494fe.jpg', 450, 35000, 'Hanvet', 'Dung dịch trị bệnh cho gà và vẹt cảnh. Chữa các bệnh toi rù, phân xanh, phân trắng trên gà, vẹt cảnh bỏ ăn, ngáp gió, ủ rũ'),
