(10190, 'Đồ dùng, chăm sóc, sức khỏe, nệm, bông, chó, mèo', 'Đồ dùng cho mèo', 'Nệm ngủ tròn mèo đuôi bông cho chó mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/a9/2f/03/0ae87147d36c8713dd64b8da520f895d.jpg', 500, 271000, 'OEM', 'Làm từ sợi bông sạch và chất vải coton thông thoáng, an toàn, mềm mại, êm ái giúp thú cưng luôn cảm thấy ấm cúng và thoải mái. Đường may tỉ mĩ và chắc chắn. Nhiều màu sắc đẹp mắt. Có khóa kéo vỏ nệm, dễ dàng giặt vệ sinh. Size M: 43cm Size L: 50cm Thích hợp cho các bé cún và miu nhỏ. Tránh nhiệt độ cao và ẩm ướt, tránh giặc máy (mất dáng)'),
(10191, 'Đồ dùng, chăm sóc, sức khỏe, nhà, gỗ, mèo', 'Đồ dùng cho mèo', 'Nhà Gỗ Hình Hộp Cho Mèo #CH002', 'https://salt.tikicdn.com/cache/200x200/ts/product/07/21/00/2064d8823275d5447bda067bf319743d.jpg', 500, 1900000, 'OEM', 'Kích thước: M (D50xR50xC60cm).  Chất liệu: ván Plywood dày 15mm siêu bền, an toàn. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển. Nhà Boss mang phong cách hiện đại phù hợp với cả những căn hộ chung cư'),
(10192, 'Đồ dùng, chăm sóc, vệ sinh, nước hoa, chó, mèo', 'Đồ dùng cho mèo', 'Nước Hoa Cho Chó Mèo SOS 75ml ( giao màu ngẫu nhiên )', 'https://salt.tikicdn.com/cache/200x200/ts/product/a9/c6/58/b1b758f4c167c7b32664603d5b1522d6.jpg', 500, 48000, 'SOS', 'Giữ mùi lên đến 6 tiếng Khử mùi hôi của da, lông. Tỏa hương thơm nhẹ nhàng lưu giữ lâu trên mình thú. Hỗ trợ diệt khuẩn trên da, lông'),
(10193, 'Đồ dùng, chăm sóc, sức khỏe, balo, chó, mèo', 'Đồ dùng cho mèo', 'Balo phi hành gia Minion cho chó mèo ', 'https://salt.tikicdn.com/cache/200x200/ts/product/37/b5/22/e5a8cb7ffe0a8342f17d93c59bb267e5.jpeg', 500, 370000, 'OEM', 'Size 48×20×25 cm cho bé 6,3kg trở xuống. Có nhiều lỗ xung quanh balo giúp thông thoáng không gian cho bé. Tay cầm và vai đeo chắc chắn. Mặt kính tròn trong suốt giúp bé có thể nhìn ra ngoài và chủ có thể quan sát bé từ bên ngoài'),
(10194, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, giấy, tai, chó, mèo', 'Đồ dùng cho mèo', 'Giấy Vệ Sinh Tai Cho Mèo Lee & Webster LW410 (40 Miếng)', 'https://salt.tikicdn.com/cache/200x200/ts/product/93/e5/51/4dbf8a02e63f43d7a415c66eecaf7944.jpg', 500, 190000, 'Lee & Webster', 'Có tác dụng bảo vệ đôi tai, ngăn ngừa các bệnh viêm nhiễm về tai ở thú cưng của bạn đồng thời còn mang đến mùi hương thơm nhẹ nhàng tự nhiên làm cho thú cưng của bạn sảng khoái và thích thú. Loại bỏ vảy nến, bụi bẩn bên trong và khu vực xung quanh tai. Không gây kích ứng da. Giữ cho tai luôn sạch sẽ, ngăn ngừa các bệnh về tai. An toàn cho da, dùng được cho da nhạy cảm.'),
(10195, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, kem, chân, mèo', 'Đồ dùng cho mèo', 'Kem Chăm Sóc Chân Cho Mèo Lee & Webster LW411 (11g)', 'https://salt.tikicdn.com/cache/200x200/ts/product/d9/68/82/6a20452e5ea9c42a7ba3b2fb3f06f92f.jpg', 500, 200000, 'Lee & Webster', 'Giúp bảo vệ đôi chân, ngăn ngừa các bệnh nấm mốc, kí sinh trùng gây ra, đồng thời kem chăm sóc chân. Mùi hương thơm nhẹ nhàng tự nhiên làm cho thú cưng của bạn sảng khoái và thích thú. Chứa 95% thảo dược thiên nhiên. Cung cấp chất dưỡng ẩm cho da và lòng bàn chân. Giảm tình trạng nứt nẻ và khô da. Không gây kích ứng da.'),
(10196, 'Đồ dùng, chăm sóc, sức khỏe, khay, mèo', 'Đồ dùng cho mèo', 'Khay Ăn Xinh Xắn Cho Mèo #CT006', 'https://salt.tikicdn.com/cache/200x200/ts/product/88/6f/07/27934597a58367932cbdca7603ae81d0.jpg', 500, 230000, 'OEM', 'Kích thước: D25 x R13 x C6cm. Phù hợp với bé mèo có cân nặng <7kg. Chất liệu: Gỗ Plywood siêu bền dày 15mm, rất chắc chắn, có thẩm mỹ cao. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển'),
(10197, 'Đồ dùng, chăm sóc, sức khỏe, nhà, mèo', 'Đồ dùng cho mèo', 'Nhà Beta Hiện Đại Cho Mèo #CH011', 'https://salt.tikicdn.com/cache/200x200/ts/product/cb/a2/54/b3b0a896e84edcd4da619df24011d9e7.jpg', 500, 1900000, 'OEM', 'Kích thước: D40 x R40 x C55cm. Phù hợp với \"mèo phi hành gia\" có cân nặng <7kg. Chất liệu: Gỗ Plywood siêu bền dày 10mm, rất chắc chắn, có thẩm mỹ cao. Lắp ráp dễ dàng, gọn gàng, dễ vệ sinh và vận chuyển. Nhà Boss mang phong cách sang trọng hiện đại phù hợp ngay với cả những căn hộ chung cư'),
(10198, 'Đồ dùng, chăm sóc, sức khỏe, vệ sinh, lồng, tắm, mèo', 'Đồ dùng cho mèo', 'Lồng Tắm Cho Mèo Kún Miu Cỡ Nhỏ (45 x 12 x 26 cm)', 'https://salt.tikicdn.com/cache/200x200/ts/product/c6/82/c7/affcfba9a6ec2d7691015cd117ab83a6.jpg', 500, 205000, 'Kún Miu', 'Chuyên dụng cho mèo dành để tắm cho những chú mèo khó tính, ghét nước và sợ tắm. Mục đích ra đời của sản phẩm này giúp tắm cho mèo một cách nhanh hơn, sạch sẽ hơn và đảm bảo an toàn cho người nuôi. Lồng tắm chuyên dụng cho mèo sử dụng dây thép với độ bền tốt nhất cùng với thiết kế 2 cửa, giải quyết tình huống mèo có thể vào dễ dàng nhưng lại không thể ra được. Thiết kế tay cầm dễ dàng, bạn có mang chú mèo của mình đi ra ngoài chơi hay đi du lịch cũng vô cùng thuận tiện. Đáy lồng với kết cấu hình lưới, nếu như bạn để móng của chú mèo nhà mình quá dài, sẽ rất dễ bị móc vào, gây tổn thương, vì vậy hãy nhớ phải cắt móng cho chúng thường xuyên nhé.'),
(10199, 'Đồ dùng, chăm sóc, sức khỏe, bát, ăn, uống, chó, mèo', 'Đồ dùng cho mèo', 'Bát Ăn Uống Tự Động Cho Chó Mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/45/81/17/a44a57e0e38cfbdc17abbe1c6a3d1a52.png', 500, 190000, 'OEM', 'Sản phẩm được sản xuất bởi chất liệu nhựa an toàn với con người và động vật. Sản phẩm bao gồm hộp đựng thức ăn hạt kết hợp bình đựng nước 2 trong 1 vô cùng tiện lợi. Có gắn thêm chân đế chống trơn trượt và thiết kế khoa học giúp cho khi đổ đầy nước thì trọng tâm sẽ hướng xuống dưới. Thiết kế tiện lợi dành cho các bạn bận rộn không có nhiều thời gian chăm sóc boss, hoặc đi du lịch.'),
(10200, 'Đồ dùng, chăm sóc, sức khỏe, vòng, cổ, ruồi, muỗi, chó, mèo', 'Đồ dùng cho mèo', 'Vòng thơm thư giãn giảm stress chống ruồi muỗi cho chó mèo', 'https://salt.tikicdn.com/cache/200x200/ts/product/a9/35/61/81e3ddadefa54c81b4de77283603e556.jpg', 500, 85000, 'Genyo', 'Vòng đeo giảm stress lo buồn cho thú cưng. Chiết xuất tinh dầu lavender giúp thú cưng thư giãn chống stress. Chống lo âu trong các trường hợp thay đổi chỗ ở, đổi chủ, thay đổi mỗi trường. Chống được ve rận ruồi muỗi ký sinh trùng'),
(10201, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó dưới 10kg Merial Frontline Plus', 'https://www.petmart.vn/wp-content/uploads/2013/02/thuoc-tri-ve-ran-cho-cho-duoi-10kg-merial-frontline-plus.jpg', 50, 210000, 'MERIAL', 'Thuốc trị ve rận cho chó dưới 10kg Merial Frontline Plus. Phù hợp với tất cả các giống chó. Frontline Plus sử dụng để nhỏ vào gáy, ở vị trí đặc biệt này các bé sẽ không thể liếm được thuốc.'),
(10202, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 2.5 đến 3kg NextGard Spectra', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-2-5-den-3kg-nextgard-spectra.jpg', 50, 325000, 'NEXTGARD', 'Thuốc trị ve rận cho chó NextGard Spectra áp dụng với các giống chỉ từ 2.5 đến 3kg.Đặc biệt, NextGard Spectra còn kết hợp tẩy giun cho thú cưng'),
(10203, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc xịt trị ve rận cho chó mèo Merial Frontline Spray Treatment', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-xit-tri-ve-ran-cho-cho-meo-merial-frontline-spray-treatment.jpg', 50, 250000, 'MERIAL', 'Thuốc có dược tính nhẹ nhàng không ngấm vào máu. Vì thế an toàn sử dụng cho chó mèo. Bao gồm chó đang cho con bú và chó mèo con. Không làm hại đến thú cưng và người. Sử dụng lâu dài có thể làm sạch sâu bọ hoàn toàn.'),
(10204, 'thuốc, chăm sóc, sức khỏe, vệ sinh, chó, mèo, ghẻ, nấm', 'Thuốc thú y ', 'Thuốc trị ghẻ nấm cho chó mèo Alkin Mitecyn', 'https://www.petmart.vn/wp-content/uploads/2015/03/thuoc-tri-ghe-nam-cho-cho-meo-alkin-mitecyn.jpg', 50, 155000, 'ALKIN', 'Thuốc trị ghẻ nấm cho chó mèo Alkin Mitecyn áp dụng cho tất cả các giống chó và mèo từ  12 tuần tuổi trở lên.Thuốc trị ghẻ nấm cho chó mèo Alkin Mitecyn đặc trị ve rận, bọ chét, nấm và các bệnh ngoài da của chó mèo do vi khuẩn gây nên.'),
(10205, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 10 đến 20kg Merial Frontline Plus', 'https://www.petmart.vn/wp-content/uploads/2013/02/thuoc-tri-ve-ran-cho-cho-tu-10-den-20kg-merial-frontline-plus.jpg', 50, 230000, 'MERIAL', 'Thuốc trị ve rận cho chó từ 10 đến 20kg Merial Frontline Plus. Dành cho các giống chó lớn và trung bình.Frontline Plus sử dụng để nhỏ vào gáy. Ở vị trí đặc biệt này các bé sẽ không thể liếm được thuốc.'),
(10206, 'thuốc, chăm sóc, sức khỏe, vệ sinh, chó, mèo, viêm, da', 'Thuốc thú y ', 'Thuốc trị viêm da cho chó mèo Saloge All Purpose Spray', 'https://www.petmart.vn/wp-content/uploads/2016/07/thuoc-tri-viem-da-cho-cho-meo-saloge-all-purpose-spray.jpg', 50, 150000, 'SALOGE', 'Thuốc trị viêm da cho chó mèo Saloge All Purpose Spray là thuốc chuyên trị viêm da, ghẻ nấm ngoài da cho chó và mèo. Tác dụng chính là trị vảy nấm, mủ nhờn, ghẻ Demodex. Diệt ve rận, bọ chét và các vi khuẩn gây viêm da.');
INSERT INTO `products` (`productCode`, `keywords`, `productLine`, `productName`, `image`, `productQuantity`, `price`, `producer`, `productDescription`) VALUES
(10207, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 20 đến 40kg Merial Frontline Plus', 'https://www.petmart.vn/wp-content/uploads/2013/02/thuoc-tri-ve-ran-cho-cho-tu-20-den-40kg-merial-frontline-plus.jpg', 50, 250000, 'MERIAL', 'Frontline Plus sử dụng để nhỏ vào gáy, ở vị trí đặc biệt này các bé sẽ không thể liếm được thuốc. Lượng thuốc sử dụng rất nhỏ nên không làm lông thú bị ướt nhiều.'),
(10208, 'thuốc, chăm sóc, sức khỏe, vệ sinh, giun, chó, mèo', 'Thuốc thú y ', 'Thuốc tẩy giun cho chó mèo Zantel', 'https://www.petmart.vn/wp-content/uploads/2016/09/thuoc-tay-giun-cho-cho-meo-zantel.jpg', 50, 60000, 'Zantel', 'Thuốc tẩy giun cho chó mèo Zantel trị giun sán, giun đũa, giun móc, giun kim và giun kí sinh ở phạm vi rộng, giun tròn và sán dây trong cơ thể chó và mèo. Có thể dùng kèm với thức ăn hoặc cho dùng cho vật nuôi khi đói để đạt được hiệu quả tốt nhất.'),
(10209, 'thuốc, chăm sóc, sức khỏe, vệ sinh, nấm, chó, mèo', 'Thuốc thú y ', 'Thuốc trị nấm cho chó mèo hiệu quả Alkin Fungikur', 'https://www.petmart.vn/wp-content/uploads/2015/03/thuoc-tri-nam-cho-cho-meo-hieu-qua-alkin-fungikur.jpg', 50, 155000, 'ALKIN', 'Thuốc trị nấm cho chó mèo hiệu quả Alkin Fungikur chuyên điều trị nhiễm nấm, nấm ngoài da, ngứa trầm trọng. Các bệnh ngoài da và nhiều triệu chứng khác. Có khả năng chữa lành nhiều loại bệnh nhiễm trùng nấm và nhiễm nấm trộn mạt.'),
(10210, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó, mèo', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó mèo Saloge Flea & Tick Spray', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-tri-ve-ran-cho-cho-meo-saloge-flea-tick-spray.jpg', 50, 150000, 'SALOGE', 'Thuốc trị ve rận cho chó mèo Saloge Flea & Tick Spray nhanh chóng giết chết bọ chét và ve rận trên bề mặt lông ngoài da ngay lập tức. Ngoài ra sản phẩm thuốc trị rận cho chó mèo còn có tác dụng hiệu quả trong việc loại bỏ ấu trùng, trứng ve rận. Phòng chống bọ chét… gây ra viêm da, dị ứng.'),
(10211, 'thuốc, chăm sóc, sức khỏe, vệ sinh, chó, giun', 'Thuốc thú y ', 'Thuốc xổ giun cho chó con Bayer Drontal For Puppies', 'https://www.petmart.vn/wp-content/uploads/2017/02/thuoc-xo-giun-cho-cho-con-bayer-drontal-puppies.jpg', 50, 55000, 'BAYER', 'Thuốc xổ giun cho chó con Bayer Drontal For Puppies giúp tiêu diệt tất cả những loài giun trưởng thành và ấu trùng nguy hiểm trên chó. Giải quyết những vấn đề gây rối loạn tiêu hóa, bỏ ăn, có hiện tượng mệt mỏi do giun phá.'),
(10212, 'thuốc, chăm sóc, sức khỏe, vệ sinh, rận, chó, mèo, tai', 'Thuốc thú y ', 'Thuốc trị rận tai cho chó mèo Joyce & Dolls Pet Ear Treatment', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-tri-ran-tai-cho-cho-meo-joyce-dolls-pet-ear-treatment.jpg', 50, 110000, 'JOYCE DOLLS', 'Thuốc trị rận tai cho chó mèo Joyce & Dolls Pet Ear Treatment diệt sạch các ký sinh trùng trong tai của chó mèo. Đặc biệt là ve – rận. Sản phẩm làm hạn chế sự tăng trưởng của các vi sinh vật trong tai của vật nuôi, giảm bớt viêm ngứa, nhiễm trùng trong tai.'),
(10213, 'thuốc, chăm sóc, sức khỏe, vệ sinh, giun, chó', 'Thuốc thú y ', 'Thuốc trị giun tim cho chó bé Heartgard Plus', 'https://www.petmart.vn/wp-content/uploads/2013/06/thuoc-tri-giun-tim-cho-cho-be-heartgard-plus.jpg', 50, 105000, 'MERIAL', 'Heartgard Plus tiêu diệt ấu trùng giun móc để phòng ngừa bệnh giun móc, chữa trị và ức chế giun đũa (giun đũa Toxocara) và bệnh giun móc (giun móc sợi, giun móc đầu dẹt). '),
(10214, 'thuốc, chăm sóc, sức khỏe, vệ sinh, tai, viêm, chó, mèo', 'Thuốc thú y ', 'Thuốc trị viêm tai cho chó mèo Saloge Earmax', 'https://www.petmart.vn/wp-content/uploads/2013/02/thuoc-tri-viem-tai-cho-cho-meo-saloge-earmax.jpg', 50, 110000, 'SALOGE', 'Thuốc trị viêm tai cho chó mèo Saloge Earmax là sản phẩm điều trị đặc biệt cho các bệnh về tai ở vật nuôi. Dành cho cả chó và mèo bị các bệnh như viêm tai giữa, vảy nấm, ghẻ, mẩn ngứa… do ký sinh trùng, ve rận cắn. Ngoài ra thuốc còn điều trị mùi hôi trong tai do vi khuẩn gây ra.'),
(10215, 'thuốc, chăm sóc, sức khỏe, vệ sinh, nấm, chó, mèo', 'Thuốc thú y ', 'Thuốc chữa nấm ngoài da chó mèo Alkin Fabricon', 'https://www.petmart.vn/wp-content/uploads/2015/03/thuoc-chua-nam-ngoai-da-cho-meo-alkin-fabricon.jpg', 50, 155000, 'ALKIN', 'Thuốc chữa nấm ngoài da chó mèo Alkin Fabricon chuyên điều trị nhiễm nấm, nấm ngoài da, ngứa trầm trọng. Mở rộng quy mô và các triệu chứng khác dành riêng cho chó mèo với sự tác động đáng kể, an toàn, kích ứng cực thấp.'),
(10216, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 10 đến 25kg Nextgard', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-10-den-25kg-nextgard.jpg', 50, 235000, 'NEXTGARD', 'Thuốc trị ve rận cho chó Nextgard áp dụng các giống chó từ 10 đến 25kg.Thuốc trị ve rận cho chó Nextgard có tác dụng bảo vệ thú cưng khỏi ve rận, bọ chét'),
(10217, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 2 đến 4kg Nextgard', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-2-den-4kg-nextgard.jpg', 50, 165000, 'NEXTGARD', 'Thuốc trị ve rận cho chó Nextgard áp dụng các giống chó từ 2 đến 4kg.Thuốc trị ve rận cho chó Nextgard có tác dụng bảo vệ thú cưng khỏi ve rận, bọ chét'),
(10218, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 4 đến 10kg Nextgard', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-4-den-10kg-nextgard.jpg', 50, 175000, 'NEXTGARD', 'Thuốc trị ve rận cho chó Nextgard áp dụng các giống chó từ 4 đến 10kg.Thuốc trị ve rận cho chó Nextgard có tác dụng bảo vệ thú cưng khỏi ve rận, bọ chét'),
(10219, 'thuốc, chăm sóc, sức khỏe, vệ sinh, mắt, chó, mèo', 'Thuốc thú y ', 'Thuốc trị chảy nước mắt cho chó mèo Saloge Shinyeyes', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-tri-chay-nuoc-mat-cho-cho-meo-saloge-shinyeyes.jpg', 50, 150000, 'SALOGE', 'Thuốc trị chảy nước mắt cho chó mèo Saloge Shinyeyes chống chảy nước mắt cho chó mèo. Có tác dụng loại bỏ những vết bẩn trên mắt. Khôi phục lại màu lông bị vệt ngả màu của tuyến nước mắt làm cho mắt của chó mèo luôn sạch và sáng hơn.'),
(10220, 'thuốc, chăm sóc, sức khỏe, vệ sinh, nấm, chó, mèo', 'Thuốc thú y ', 'Thuốc trị nấm cho chó mèo Saloge Fungicide Spray', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-tri-nam-cho-cho-meo-saloge-fungicide-spray.jpg', 50, 150000, 'SALOGE', 'Thuốc trị nấm cho chó mèo Saloge Fungicide Spray có tác dụng loại bỏ nhanh chóng các loại nấm trên bề mặt da của vật nuôi như nấm da, rụng lông do nấm, hắc lào, phát ban và ngứa do nấm, mưng mủ. '),
(10221, 'thuốc, chăm sóc, sức khỏe, vệ sinh, tai, chó, mèo', 'Thuốc thú y ', 'Dung dịch vệ sinh tai cho chó mèo Saloge Earclean', 'https://www.petmart.vn/wp-content/uploads/2013/03/dung-dich-vesinh-tai-cho-cho-meo-saloge-earclean.jpg', 50, 150000, 'SALOGE', 'Dung dịch vệ sinh tai cho chó mèo Saloge Earclean có chức năng làm sạch ráy tai, làm sạch và khử mùi hôi tai cho chó mèo hiệu quả. Thích hợp cho việc chăm sóc và sử dụng hàng ngày cho thú cưng của bạn.'),
(10222, 'thuốc, chăm sóc, sức khỏe, vệ sinh, mắt, chó, mèo', 'Thuốc thú y ', 'Thuốc chữa đau mắt cho chó mèo Saloge Eyedrop', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-chua-dau-mat-cho-cho-meo-saloge-eyedrop.jpg', 50, 110000, 'SALOGE', 'Thuốc chữa đau mắt cho chó mèo Saloge Eyedrop với chức năng chủ yếu là khử trùng. Chữa đau mắt đỏ, chống viêm mắt, ngứa mắt. Loại bỏ các vi khuẩn gây ra bệnh nhiễm trùng mắt, viêm giác mạc, đau mắt hột, viêm kết mạc, viêm mí mắt và các bệnh dị ứng truyền nhiễm về mắt.'),
(10223, 'thuốc, chăm sóc, sức khỏe, vệ sinh, da, chó, mèo', 'Thuốc thú y ', 'Thuốc trị bệnh ngoài da cho chó mèo Saloge Acaricide Spray', 'https://www.petmart.vn/wp-content/uploads/2013/03/thuoc-tri-benh-ngoai-da-cho-cho-meo-saloge-acaricide-spray.jpg', 50, 150000, 'SALOGE', 'Thuốc trị bệnh ngoài da cho chó mèo Saloge Acaricide Spray nhanh chóng giết chết vi khuẩn có hại trên bề mặt lông ngoài da của chó mèo. Ngoài ra còn có tác dụng hiệu quả trong việc loại bỏ các chất nhờn. Điều trị bệnh ghẻ do ve gây ra và khắc phục các vấn đề về ngứa, mưng mủ trên da của vật nuôi…'),
(10224, 'thuốc, chăm sóc, sức khỏe, vệ sinh, giun, chó', 'Thuốc thú y ', 'Thuốc trị giun tim cho chó nhỡ Heartgard Plus', 'https://www.petmart.vn/wp-content/uploads/2013/06/thuoc-tri-giun-tim-cho-cho-nho-heartgard-plus.jpg', 50, 125000, 'MERIAL', 'Thuốc trị giun tim cho chó nhỡ Heartgard Plus hương vị thịt bò là sản phẩm dành cho chó cỡ lớn thể trọng từ 11,5 đến 22,5kg có tác dụng phòng ngừa truyền nhiễm giun móc, điều tri truyền nhiễm giun đũa hiệu quả.'),
(10225, 'thuốc, chăm sóc, sức khỏe, vệ sinh, giun, chó', 'Thuốc thú y ', 'Thuốc trị giun tim cho chó lớn Heartgard Plus', 'https://www.petmart.vn/wp-content/uploads/2013/06/thuoc-tri-giun-tim-cho-cho-lon-heartgard-plus.jpg', 50, 145000, 'MERIAL', 'Thuốc trị giun tim cho chó lớn Heartgard Plus hương vị thịt bò là sản phẩm dành cho chó cỡ lớn thể trọng từ 22,5 đến 45kg có tác dụng phòng ngừa truyền nhiễm giun móc, điều tri truyền nhiễm giun đũa hiệu quả. '),
(10226, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 3.6 đến 7.5kg NextGard Spectra', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-3-6-den-7-5kg-nextgard-spectra.jpg', 50, 345000, 'NEXTGARD', 'Thuốc trị ve rận cho chó NextGard Spectra sẽ giúp bạn thật an tâm khi thú cưng sạch rận bọ mà lại an toàn. Đặc biệt, NextGard Spectra còn kết hợp tẩy giun cho thú cưng '),
(10227, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 7.6 đến 15kg NextGard Spectra', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-7-6-den-15kg-nextgard-spectra.jpg', 50, 385000, 'NEXTGARD', 'Thuốc trị ve rận cho chó NextGard Spectra sẽ giúp bạn thật an tâm khi thú cưng sạch rận bọ mà lại an toàn. Đặc biệt, NextGard Spectra còn kết hợp tẩy giun cho thú cưng '),
(10228, 'thuốc, chăm sóc, sức khỏe, vệ sinh, ve, rận, chó', 'Thuốc thú y ', 'Thuốc trị ve rận cho chó từ 25 đến 50kg Nextgard', 'https://www.petmart.vn/wp-content/uploads/2019/05/thuoc-tri-ve-ran-cho-cho-tu-25-den-50kg-nextgard.jpg', 50, 545000, 'NEXTGARD', 'Thuốc trị ve rận cho chó Nextgard có tác dụng bảo vệ thú cưng khỏi ve rận, bọ chét. Làm giảm khả năng nhiễm khuẩn khi loại bỏ bọ chét'),
(10229, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', 'Thức ăn cho chim Bird Choize All Species For all birds', 'https://www.vietpet.net/wp-content/uploads/2018/09/thuc-an-cho-chim-bird-choize-all-species-for-all-birds.jpg', 50, 65000, 'Bird Choize', 'Thức ăn cho chim Bird Choize All Species For all birds cân bằng của các axit amin thiết yếu và các chất dinh dưỡng khác thường được tìm thấy trong côn trùng để tăng cường hiệu suất tăng trưởng.'),
(10230, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', 'Thức ăn cho chim A Pro IQ Formula Dove', 'https://www.vietpet.net/wp-content/uploads/2018/09/thuc-an-cho-chim-a-pro-iq-formula-dove.jpg', 50, 74000, 'A Pro', 'Thức ăn cho chim A Pro IQ Formula Dove cấp các axit amin thiết yếu bổ sung tự nhiên có lợi nhuận thấp và hạt giống từ các nguồn protein tiêu hóa cao và các axit amin riêng lẻ; tất cả các vitamin, khoáng chất và nguyên tố vi lượng cần thiết; và các chất dinh dưỡng vĩ mô và vi lượng thiết yếu khác.'),
(10231, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', 'Thức ăn cho chim MaxWin Pigeon', 'https://www.vietpet.net/wp-content/uploads/2018/09/thuc-an-cho-chim-maxwin-pigeon.jpg', 50, 660000, 'MAXWIN\r\n', 'Thức ăn cho chim MaxWin Pigeon cung cấp các axit amin thiết yếu bổ sung tự nhiên. Có lợi nhuận thấp và hạt giống từ các nguồn protein tiêu hóa cao và các axit amin riêng lẻ; tất cả các vitamin, khoáng chất và nguyên tố vi lượng cần thiết; và các chất dinh dưỡng vĩ mô và vi lượng thiết yếu khác.'),
(10232, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', '100G HẠT TRÁI CÂY ZUMPREEM CHO LOVEBIRD, COCKATIEL, YẾN PHỤNG, PARROTLET', 'https://cdn.fado.vn/images/I/51L9fY15lzL._SR600,600_.jpg', 50, 42000, 'ZuPreem', 'ZuPreem FruitBlend có công thức dinh dưỡng cao và cân bằng giúp chim phát triển nhanh hơn và cho bộ lông sáng đẹp hơn.\r\nZuPreem FruitBlend chứa vi sinh có lợi cho sức khoẻ và đường tiêu hoá của chim'),
(10233, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt cỡ lớn ZuPreem FruitBlend with Natural Fruit Flavors Large', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-co-lon-zupreem-fruitblend-with-natural-fruit-flavors-large.jpg', 50, 180000, 'ZuPreem ', 'ZuPreem FruitBlend có công thức dinh dưỡng cao và cân bằng giúp chim phát triển nhanh hơn và cho bộ lông sáng đẹp hơn.\r\nZuPreem FruitBlend chứa vi sinh có lợi cho sức khoẻ và đường tiêu hoá của chim'),
(10234, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt nhỏ vị trái cây ZuPreem FruitBlend with Natural Fruit Flavors', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-nho-vi-trai-cay-zupreem-fruitblend-with-natural-fruit-flavors.jpg', 50, 150000, 'ZuPreem ', 'Cung cấp dinh dưỡng phù hợp và tối cao được nạp với trái cây như cam, táo, nho và chuối cộng với tất cả các chất dinh dưỡng cần thiết mà chim của bạn cần mỗi ngày để có sức khỏe tốt'),
(10235, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt ZuPreem Natural with Vitamins, Minerals & Amino Acids Parrot & Conure', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-zupreem-natural-with-vitamins-minerals-amino-acids-parrot-conure.jpg', 50, 180000, 'ZuPreem ', 'Là một loại thực phẩm tự nhiên lành mạnh được pha chế với tất cả các chất dinh dưỡng mà vẹt và vẹt cần mỗi ngày. Thức ăn dạng viên này nên được cho ăn 80% khẩu phần ăn hàng ngày của chim thú cưng của bạn để đảm bảo dinh dưỡng hợp lý và giữ cho chim của bạn hoạt động.'),
(10236, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt ZuPreem AvianBreeder FruitBlend with Natural Fruit Flavors Parrot & Conure Bird\r\n', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-zupreem-avianbreeder-fruitblend-with-natural-fruit-flavors-parrot-conure-bird.jpg', 50, 155000, 'ZuPreem', 'Công thức để nhân giống châu Phi, vẹt, amazons và vẹt mào. Được chế tạo với các thành phần thực sự dễ nhận biết như ngô xay, bột đậu nành, lúa mì xay, cam, táo, nho và chuối.'),
(10237, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt ZuPreem VeggieBlend Flavor Parrot & Conure', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-zupreem-veggieblend-flavor-parrot-conure.jpg', 50, 550000, 'ZuPreem', 'Chế độ ăn uống cao cấp hàng ngày cho nhiều loại chim, bao gồm cả Conure, Greys và Cockatoos.Cung cấp vitamin và khoáng chất thiết yếu, cung cấp cho chim thú cưng của bạn một nguồn dinh dưỡng cân bằng đáng tin cậy'),
(10238, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt ZuPreem Smart Selects Macaw Bird', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-zupreem-smart-selects-macaw-bird.jpg', 50, 230000, 'ZuPreem', 'Món ăn ngon này có đầy đủ các hương vị hấp dẫn, màu sắc rực rỡ và một loạt các hình dạng và kết cấu. Vẹt đuôi dài của bạn sẽ yêu thích hương vị của các loại ngũ cốc, hạt và trái cây khô lành mạnh cung cấp các chất dinh dưỡng cần thiết và chất chống oxy hóa để giữ cho anh ta khỏe mạnh và năng động.'),
(10239, 'Đồ ăn, chăm sóc, sức khỏe, chim, sẻ, hoàng yến', 'Đồ ăn cho chim', 'Thức ăn cho chim Sẻ và Hoàng Yến ZuPreem Smart Selects Canary & Finch Bird', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-chim-se-va-hoang-yen-zupreem-smart-selects-canary-finch-bird.jpg', 50, 90000, 'ZuPreem', 'Công thức đặc biệt cho chim hoàng yến, chim sẻ và các loài chim rất nhỏ khác. Không giống như các hỗn hợp khác, nó để lại hạt hướng dương thường chứa nhiều carbs và chất béo và thiếu chất dinh dưỡng quan trọng'),
(10240, 'Đồ ăn, chăm sóc, sức khỏe, chim, sẻ, hoàng yến', 'Đồ ăn cho chim', 'Thức ăn cho chim Sẻ và Hoàng Yến ZuPreem FruitBlend with Natural Fruit Flavors Extra Small Bird', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-chim-se-va-hoang-yen-zupreem-fruitblend-with-natural-fruit-flavors-extra-small-bird.jpg', 50, 120000, 'ZuPreem', 'Chế độ ăn uống hàng ngày cao cấp cung cấp dinh dưỡng phù hợp và tối cao được nạp bằng trái cây như cam, táo, nho và chuối cộng với tất cả các chất dinh dưỡng thiết yếu mà chim bạn cần mỗi ngày để có sức khỏe tốt. Không cần bổ sung vitamin hoặc khoáng chất bổ sung trong khi cho người bạn lông vũ của bạn chế độ ăn uống đầy đủ và cân bằng này.'),
