(10252, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', 'Thức ăn cho chim SmartHeart Shama', 'https://www.vietpet.net/wp-content/uploads/2018/09/thuc-an-cho-chim-smartheart-shama.jpg', 50, 24000, 'SmartHeart', 'Thức ăn cho chim SmartHeart Shama là thực phẩm cân bằng dinh dưỡng hoàn chỉnh được phát triển đặc biệt cho các loài chim ăn côn trùng như chích chòe lửa. Thành phần: sâu ăn, trứng khô, bột cá cao cấp, axit amin thiết yếu, thảo mộc Thái Lan, vitamin, khoáng chất và chất dinh dưỡng khác.'),
(10253, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', 'Thức ăn cho chim A Pro IQ Formula Mynah', 'https://www.vietpet.net/wp-content/uploads/2018/09/thuc-an-cho-chim-a-pro-i-q-formula-mynah.jpg', 50, 150000, 'A Pro', 'Cũng cấp dinh dưỡng cần thiết.\r\nTăng cường màu sắc cho lông.\r\nTăng khả năng hấp thụ, tiêu hóa tốt.'),
(10254, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt Wild Harvest Advanced Nutrition Diet Parrot Bird Food', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-wild-harvest-advanced-nutrition-diet-parrot-bird-food.jpg', 50, 140000, 'Wild Harvest', 'Hạt, ngũ cốc và rau cung cấp cho vẹt của bạn nhiều chất dinh dưỡng có lợi.Chứa vitamin, khoáng chất và axit béo omega-3 để thúc đẩy làn da khỏe mạnh và lông sáng bóng, bóng.'),
(10255, 'Đồ ăn, chăm sóc, sức khỏe, chim', 'Đồ ăn cho chim', 'Thức ăn cho chim giống nhỏ Wild Harvest Universal Blend Small Bird Food', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-chim-giong-nho-wild-harvest-universal-blend-small-bird-food.jpg', 50, 65000, 'Wild Harvest', 'Được pha trộn cho các loài chim nhỏ, chế độ ăn này là lý tưởng cho chim hoàng yến, vẹt đuôi dài, chim sẻ.Được làm bằng hạt cao cấp, như hạt cỏ hoàng yến, kê đỏ và trắng, và các loại hạt lành mạnh mà chim yêu thích.Cung cấp vitamin và khoáng chất chim nhỏ cần.'),
(10256, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt Wild Harvest Advanced Nutrition Diet Parakeet Bird Food', 'https://www.vietpet.net/wp-content/uploads/2020/02/thuc-an-cho-vet-wild-harvest-advanced-nutrition-diet-parakeet-bird-food.jpg', 50, 55000, 'Wild Harvest', 'Hạt và ngũ cốc cung cấp cho con vẹt của bạn một loạt các chất dinh dưỡng có lợi. Chứa vitamin, khoáng chất và axit béo omega-3 để thúc đẩy làn da khỏe mạnh và lông sáng bóng, bóng.'),
(10257, 'Đồ ăn, chăm sóc, sức khỏe, chim, vẹt', 'Đồ ăn cho chim', 'Thức ăn cho vẹt Brown’s Encore Premium Parrot Bird', 'https://www.vietpet.net/wp-content/uploads/2019/12/thuc-an-cho-vet-browns-encore-premium-parrot-bird.jpg', 50, 90000, 'Brown’s', 'Một loại thực phẩm cao cấp, giàu vitamin được điều chế để cung cấp dinh dưỡng phù hợp cho chú vẹt của bạn. Pha trộn các loại hạt và ngũ cốc chất lượng cao nhất với nhau và phủ lên trên cùng với hình dạng thực phẩm nhiều màu sắc của chúng tôi, giúp cho thời gian cho ăn trở nên thú vị, ngon miệng, tốt cho sức khỏe và vui vẻ. Có tất cả các loại thực phẩm yêu thích của chúng, bao gồm kê đỏ và trắng, ngô, yến mạch, hạt hoàng yến, hạt rum và hạt hướng dương sọc'),
(10258, 'Đồ ăn, chăm sóc, sức khỏe, chim, bồ câu', 'Đồ ăn cho chim', 'Thức ăn cho chim bồ câu Brown’s Bird Lover’s Blend Dove, Pigeon & Quail Blend Bird', 'https://www.vietpet.net/wp-content/uploads/2019/12/thuc-an-cho-chim-bo-cau-browns-bird-lovers-blend-dove-pigeon-quail-blend-bird.jpg', 50, 50000, 'Brown’s', 'Bộ sưu tập các loại hạt và ngũ cốc chất lượng cao như kê đỏ & trắng, milo, lúa mì, đậu xanh, hạt hoàng yến, yến mạch, hạt rum và bỏng ngô.\r\nHỗn hợp đặc biệt này được thiết kế để cung cấp hạt và hạt chất lượng cao nhất cần thiết cho dinh dưỡng của bồ câu, bồ câu và chim cút'),
(10259, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ Brown’s Encore Gourmet Foraging Feast Pet Rabbit Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-browns-encore-gourmet-foraging-feast-pet-rabbit-food.jpg', 50, 110000, 'Brown’s', 'Chế độ ăn uống cao cấp này được bổ sung vitamin và khoáng chất để tăng cường sức khỏe cho thỏ. Các thành phần có hình dạng và kết cấu thú vị để giúp thỏa mãn nhu cầu nhai, giải tỏa sự nhàm chán của lồng và kích thích bản năng săn mồi tự nhiên.'),
(10260, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Country Harvest Blend Rabbit, Guinea Pig & Chinchilla Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-country-harvest-blend-rabbit-guinea-pig-chinchilla-treats.jpg', 50, 25000, 'Kaytee', 'Cung cấp cho thú cưng nhỏ của bạn một món ăn thú vị, ngon miệng và bổ dưỡng với Kaytee Country Harvest Blend Rabbit, Guinea Pig & Chinchilla Treats. Các món ăn là một cách tuyệt vời để gắn kết với thú cưng nhỏ của bạn, cung cấp cho chúng một hoạt động phong phú và thỏa mãn nhu cầu nhai của chúng. '),
(10261, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Fiesta Healthy Toppings Mixed Fruit Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-fiesta-healthy-toppings-mixed-fruit-small-animal-treats.jpg', 50, 20000, 'Kaytee', 'Các món ăn là một cách tuyệt vời để gắn kết với thú cưng nhỏ của bạn và thêm sự đa dạng vào chế độ ăn uống của chúng. '),
(10262, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Baked Carrot Timothy Biscuit Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-baked-carrot-timothy-biscuit-small-animal-treats.jpg', 50, 25000, 'Kaytee', 'Cung cấp cho thú cưng của bạn những lợi ích của cỏ khô nhiều chất xơ trong một chiếc bánh quy dễ nướng, dễ ăn với bánh quy nhỏ dành cho động vật nhỏ của Kaytee nướng Apple Timothy. Vật nuôi nhỏ bao gồm Lợn Guinea, thỏ và chinchillas cần cỏ khô để hỗ trợ quá trình tiêu hóa, giữ cho răng của chúng và đáp ứng nhu cầu nhai. '),
(10263, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Timothy Hay Plus Carrots Small Animal Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-timothy-hay-plus-carrots-small-animal-food.jpg', 50, 170000, 'Kaytee', 'Cung cấp cho thú cưng của bạn những lợi ích của cỏ khô nhiều chất xơ và cà rốt giòn, tốt cho sức khỏe với thức ăn động vật nhỏ Cà rốt Kaytee Timothy Hay Plus. Vật nuôi nhỏ bao gồm Lợn Guinea, thỏ và chinchillas cần cỏ khô để hỗ trợ quá trình tiêu hóa, giữ cho răng của chúng và đáp ứng nhu cầu nhai.'),
(10264, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Fiesta Healthy Toppings Papaya Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-fiesta-healthy-toppings-papaya-small-animal-treats.jpg', 50, 30000, 'Kaytee', 'Làm bằng trái cây thật. Thêm sự đa dạng vào chế độ ăn uống thông thường'),
(10265, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Box O’ Hay Small Animal Treat', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-box-o-hay-small-animal-treat.jpg', 50, 40000, 'Kaytee', 'Cung cấp chất xơ, chất dinh dưỡng và làm phong phú đa dạng cho các động vật nhỏ như thỏ, chuột lang, chuột đồng, chuột nhảy, chuột, chuột và chinchillas. Gói đa dạng kết hợp Timothy hay, cà rốt, bạc hà và cúc vạn thọ trong các hộp phục vụ duy nhất an toàn cho việc nhai.'),
(10266, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ Kaytee Forti-Diet Pro Health Honey Rabbit Treat Sticks', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-kaytee-forti-diet-pro-health-honey-rabbit-treat-sticks.jpg', 50, 35000, 'Kaytee', 'Điều trị thú cưng nhỏ của bạn để có một món ăn giòn, vui vẻ và ăn một chút mật ong với Que trị liệu thỏ mật ong Kaytee Forti-Diet Pro Health. Các món ăn là một cách tuyệt vời để gắn kết với thú cưng nhỏ của bạn, cung cấp cho chúng một hoạt động phong phú và thỏa mãn nhu cầu nhai của chúng.'),
(10267, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Fiesta Krunch-A-Rounds Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-fiesta-krunch-a-rounds-small-animal-treats.jpg', 50, 30000, 'Kaytee', 'Nguồn protein tuyệt vời\r\nĐược làm bằng đậu phộng, gạo và hạt vừng\r\nGiòn, vui\r\nTăng cường vitamin và khoáng chất\r\nPhần thưởng đào tạo xuất sắc'),
(10268, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Treat Stix with Superfoods Strawberry Flavor Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-treat-stix-with-superfoods-strawberry-flavor-small-animal-treats.jpg', 50, 80000, 'Kaytee', 'Những món ăn động vật nhỏ được thiết kế để thưởng cho người bạn lông xù của bạn bằng một bữa ăn nhẹ bổ dưỡng.\r\nCó các thành phần tốt cho sức khỏe và ngon miệng để làm phong phú chế độ ăn kiêng của bạn.\r\nBao gồm một siêu dâu tây và hạt lanh đứng đầu để thêm hương vị.\r\nĐi kèm ở dạng que để chúng dễ dàng cho bé ăn vặt.\r\nLý tưởng cho chuột lang, thỏ, chuột đồng và các động vật nhỏ khác.'),
(10269, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Fiesta Pop-A-Rounds Treat Small Animal Treat', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-fiesta-pop-a-rounds-treat-small-animal-treat.jpg', 50, 35000, 'Kaytee', 'Được làm bằng milo lành mạnh và tất cả giòn tự nhiên cho một món ăn bổ dưỡng cho động vật nhỏ.\r\nVới đậu phộng ngon mà thỏ và chuột lang chỉ thích và làm ngọt bằng mật ong tự nhiên.\r\nTuyệt vời như một sự bổ sung ngon lành vào chế độ ăn kiêng của bạn để giảm sự nhàm chán và kích thích sự thèm ăn ở những người kén ăn.\r\nLý tưởng như một điều trị đào tạo ngon hoặc chỉ là một phần thưởng bất cứ lúc nào sẽ làm cho liên kết với bạn của bạn thú vị hơn nhiều.\r\nĐi kèm trong một túi có thể khóa lại và được làm bằng không hương vị nhân tạo, màu sắc hoặc chất bảo quản.'),
(10270, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Timothy Hay Plus Cranberries Small Animal Treat', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-timothy-hay-plus-cranberries-small-animal-treat.jpg', 50, 70000, 'Kaytee', 'Điều trị nhiều chất xơ hỗ trợ quá trình tiêu hóa\r\nTự nhiên và không có hóa chất\r\nVới quả nam việt quất thật\r\nKhuyến khích tìm kiếm thức ăn\r\nCung cấp giải trí và kích thích tinh thần'),
(10271, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Timothy Hay Plus Marigolds Small Animal Treat', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-timothy-hay-plus-marigolds-small-animal-treat.jpg', 50, 60000, 'Kaytee', 'Điều trị nhiều chất xơ hỗ trợ quá trình tiêu hóa\r\nTự nhiên và không có hóa chất\r\nVới cúc vạn thọ\r\nKhuyến khích tìm kiếm thức ăn\r\nCung cấp giải trí và kích thích tinh thần'),
(10272, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Timothy Hay Plus Mint Small Animal Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-timothy-hay-plus-mint-small-animal-food.jpg', 50, 70000, 'Kaytee', 'Hoàn toàn tự nhiên và không có hóa chất cho một món ăn tốt cho sức khỏe và ngon miệng\r\nTimothy Hay có nhiều chất xơ và hỗ trợ tiêu hóa hợp lý\r\nCỏ được chữa khỏi nắng và là một chất kích thích sự thèm ăn tuyệt vời\r\nCung cấp một cách thú vị và tương tác cho người bạn lông xù của bạn để ăn và thức ăn gia súc\r\nHay giúp mài mòn và làm sạch răng để có sức khỏe răng miệng tốt'),
(10273, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Timothy Hay Wafer-Cut Small Animal Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-timothy-hay-wafer-cut-small-animal-food.jpg', 50, 110000, 'Kaytee', 'Hoàn toàn tự nhiên và không có hóa chất cho một món ăn tốt cho sức khỏe và ngon miệng\r\nTimothy Hay có nhiều chất xơ và hỗ trợ tiêu hóa hợp lý\r\nCỏ được chữa khỏi nắng và là một chất kích thích sự thèm ăn tuyệt vời\r\nCung cấp một cách thú vị và tương tác cho người bạn lông xù của bạn để ăn và thức ăn gia súc\r\nHay giúp mài mòn và làm sạch răng để có sức khỏe răng miệng tốt'),
(10274, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Tube ‘O Hay Timothy Hay Small Animal Treat', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-tube-o-hay-timothy-hay-small-animal-treat.jpg', 50, 110000, 'Kaytee', 'Ống cao chất xơ, an toàn để nhai.\r\nTự nhiên và không có hóa chất.\r\nĐược làm bằng timothy hay.\r\nKhuyến khích đào hầm, ẩn nấp và tìm kiếm thức ăn.\r\nCó sẵn trong trung bình và lớn.'),
(10275, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ và chuột Kaytee Carrot Alfalfa Nibblers Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-va-chuot-kaytee-carrot-alfalfa-nibblers-small-animal-treats.jpg', 50, 40000, 'Kaytee', 'Các món ăn ngon cũng như bổ dưỡng.\r\nĐược làm bằng cỏ linh lăng và cà rốt thật để làm hài lòng bạn bè thú cưng của bạn.\r\nĐáp ứng hoạt động nhai tự nhiên và thúc đẩy vệ sinh răng miệng.\r\nLàm cho một điều trị tuyệt vời cho liên kết và thời gian chơi.\r\nNhư mọi khi, được thực hiện tại Hoa Kỳ.'),
(10276, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột, cỏ, khô', 'Đồ ăn cho thỏ và chuột', 'Cỏ khô cho thỏ Oxbow Western Timothy Hay', 'https://www.vietpet.net/wp-content/uploads/2019/03/co-kho-cho-tho-oxbow-western-timothy-hay.jpg', 50, 100000, 'OXBOW', 'Thu hoạch tươi từ gia đình trang trại của chúng tôi\r\nSắp xếp bằng tay và đóng gói cẩn thận\r\nCung cấp chất xơ thiết yếu để hỗ trợ sức khỏe tiêu hóa & nha khoa\r\nKhông có màu nhân tạo, hương vị, hoặc chất bảo quản'),
(10277, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột, vitamin', 'Đồ ăn cho thỏ và chuột', 'Bổ sung vitamin c cho chuột Oxbow Natural Science Vitamin C Small Animal Supplement', 'https://www.vietpet.net/wp-content/uploads/2020/01/bo-sung-vitamin-c-cho-chuot-oxbow-natural-science-vitamin-c-small-animal-supplement.jpg', 50, 80000, 'OXBOW', 'Cung cấp Vitamin C thiết yếu và ngăn ngừa bệnh scurvy ở Guinea Lợn. Bổ sung này sẽ giúp tăng cường hệ thống miễn dịch vật nuôi của bạn.\r\nCông thức để giảm căng thẳng ở vật nuôi nhỏ khác và đồng thời hỗ trợ phục hồi.\r\nĐược sản xuất với công thức dựa trên cỏ khô, sản phẩm này có nhiều chất xơ sẽ giúp hỗ trợ một hệ thống khỏe mạnh tổng thể.\r\nĐược làm bằng các thành phần hoàn toàn tự nhiên để đặc biệt hỗ trợ sức khỏe tổng thể của một con vật nhỏ. Không có hương vị nhân tạo, màu sắc hoặc chất bảo quản.\r\nHoàn hảo cho các động vật nhỏ như Lợn Guinea, thỏ và chinchillas.'),
(10278, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho chuột lang trưởng thành Oxbow Essentials Adult Guinea Pig', 'https://www.vietpet.net/wp-content/uploads/2019/03/thuc-an-cho-chuot-lang-truong-thanh-oxbow-essentials-adult-guinea-pig.jpg', 50, 250000, 'OXBOW', 'Viên đồng nhất ngăn ngừa cho ăn chọn lọc\r\nNhiều chất xơ cho sức khỏe tiêu hóa hàng ngày\r\nTăng cường vitamin và khoáng chất cho sức khỏe tối ưu\r\nCông thức với sự hướng dẫn của các bác sĩ thú y và dinh dưỡng hàng đầu\r\nBảy mươi phần trăm khẩu phần ăn của chuột lang của bạn nên là cỏ khô. Oxbow cung cấp một loạt các vật liệu sợi cao được lựa chọn bằng tay để làm phong phú thêm cuộc sống và sức khỏe của thú cưng của bạn.'),
(10279, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, cỏ, khô', 'Đồ ăn cho thỏ và chuột', 'Cỏ khô cho thỏ Oxbow Alfalfa Hay', 'https://www.vietpet.net/wp-content/uploads/2019/03/co-kho-cho-tho-oxbow-alfalfa-hay.jpg', 50, 92000, 'OXBOW', 'Hương vị ngọt ngào và kết cấu mềm mại\r\nLý tưởng cho vật nuôi đang phát triển, mang thai hoặc cho con bú\r\nThu hoạch tươi từ gia đình trang trại của chúng tôi\r\nSắp xếp bằng tay và đóng gói cẩn thận\r\nKhông có hương vị nhân tạo, màu sắc, hoặc chất bảo quản\r\nKhông có màu nhân tạo, hương vị, hoặc chất bảo quản'),
(10280, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ làm từ thiên nhiên Oxbow Timothy Club Twists Small Animal Treats', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-lam-tu-thien-nhien-oxbow-timothy-club-twists-small-animal-treats.jpg', 50, 23000, 'OXBOW', 'Sản phẩm này được làm 100% có thể ăn được trong xây dựng. Người bạn lông nhỏ của bạn sẽ có thể ăn và ngủ ở một nơi!\r\nMón ngon này có nhiều chất xơ và sẽ giúp thú cưng của bạn giữ một hệ thống tiêu hóa khỏe mạnh.'),
(10281, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ trưởng thành Oxbow Essentials Rabbit', 'https://www.vietpet.net/wp-content/uploads/2019/03/thuc-an-cho-tho-truong-thanh-oxbow-essentials-rabbit.jpg', 50, 250000, 'OXBOW', ' Được chế tạo để đáp ứng nhu cầu dinh dưỡng cụ thể của thỏ trưởng thành và giúp chúng phát triển mạnh. Thức ăn cho thỏ trưởng thành đầy đủ và cân bằng này chứa Timothy hay cho tiêu hóa khỏe mạnh và tất cả các thành phần lành mạnh và các chất dinh dưỡng cần thiết để hỗ trợ chức năng và hiệu suất hàng ngày.'),
(10282, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, cỏ, khô', 'Đồ ăn cho thỏ và chuột', 'Cỏ khô cho thỏ Oxbow Timothy Meadow Hay', 'https://www.vietpet.net/wp-content/uploads/2019/03/co-kho-cho-tho-oxbow-timothy-meadow-hay.jpg', 50, 100000, 'OXBOW', ' Sự kết hợp phong phú của thị hiếu và kết cấu\r\nChất xơ cao cho tiêu hóa tối ưu\r\nChọn bằng tay và sắp xếp bằng tay\r\nCung cấp nhiều loại giúp ngăn ngừa kén ăn'),
(10283, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, cỏ, khô', 'Đồ ăn cho thỏ và chuột', 'Cỏ khô cho thỏ Oxbow Orchard Grass', 'https://www.vietpet.net/wp-content/uploads/2019/03/co-kho-cho-tho-oxbow-orchard-grass.jpg', 50, 100000, 'OXBOW', 'Kết cấu mềm và hương vị ngọt ngào vật nuôi yêu\r\nThu hoạch tươi từ gia đình trang trại của chúng tôi\r\nSắp xếp bằng tay và đóng gói cẩn thận\r\nCung cấp chất xơ thiết yếu để hỗ trợ sức khỏe tiêu hóa & nha khoa\r\nKhông có màu nhân tạo, hương vị, hoặc chất bảo quản'),
(10284, 'Đồ ăn, chăm sóc, sức khỏe, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho chuột hamster Oxbow Essentials Healthy Handfuls Hamster & Gerbil Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-chuot-hamster-oxbow-essentials-healthy-handfuls-hamster-gerbil-food.jpg', 50, 60000, 'OXBOW', 'Tăng cường với Vitamin C, A và B12 ổn định. Điều này giúp đảm bảo rằng hệ thống miễn dịch và sức khỏe của thú cưng của bạn ở trạng thái tốt nhất.\r\nBao gồm bột Timothy hay chất xơ cao giúp tăng cường sức khỏe đường tiêu hóa. Giữ sức khỏe thú cưng của bạn ở mức tối ưu.\r\nHamster và gerbils là động vật ăn cỏ nghiêm ngặt và chế độ ăn nhiều chất xơ là điều cần thiết để duy trì hệ tiêu hóa khỏe mạnh.'),
(10285, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ Oxbow Oat Hay Small Animal Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-oxbow-oat-hay-small-animal-food.jpg', 50, 50000, 'OXBOW', 'Tạo một hỗn hợp cỏ thơm ngon và bổ dưỡng cho thú cưng nhỏ của bạn với thực phẩm động vật nhỏ Oxbow Oat Hay. Một số vật nuôi nhỏ như Lợn Guinea, thỏ và chinchillas, cần cỏ khô để duy trì tiêu hóa khỏe mạnh.'),
(10286, 'Đồ ăn, chăm sóc, sức khỏe, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho chuột lang Oxbow’s Essentials Young Guinea Pig', 'https://www.vietpet.net/wp-content/uploads/2019/03/thuc-an-cho-chuot-lang-oxbows-essentials-young-guinea-pig1.jpg', 50, 230000, 'OXBOW', 'Viên đồng nhất ngăn ngừa cho ăn chọn lọc\r\nChứa cỏ linh lăng để đáp ứng nhu cầu năng lượng của chuột lang non, đang mang thai và cho con bú\r\nTăng cường vitamin và khoáng chất cho sức khỏe tối ưu\r\nCông thức với sự hướng dẫn của các bác sĩ thú y và dinh dưỡng hàng đầu'),
(10287, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, cỏ, khô', 'Đồ ăn cho thỏ và chuột', 'Cỏ khô cho thỏ Oxbow Oat Hay', 'https://www.vietpet.net/wp-content/uploads/2019/03/co-kho-cho-tho-oxbow-oat-hay.jpg', 50, 100000, 'OXBOW', 'Kết cấu giòn và hương vị mặn mà thú cưng yêu thích\r\nThu hoạch tươi từ gia đình trang trại của chúng tôi\r\nSắp xếp bằng tay và đóng gói cẩn thận\r\nCung cấp chất xơ thiết yếu để hỗ trợ sức khỏe tiêu hóa & nha khoa\r\nKhông có màu nhân tạo, hương vị, hoặc chất bảo quản'),
(10288, 'Đồ ăn, chăm sóc, sức khỏe, thỏ, cỏ, khô', 'Đồ ăn cho thỏ và chuột', 'Cỏ khô cho thỏ Oxbow Western Timothy and Orchard', 'https://www.vietpet.net/wp-content/uploads/2019/03/co-kho-cho-tho-oxbow-western-timothy-and-orchard.jpg', 50, 100000, 'OXBOW', 'Thỏ cưng, lợn guinea hoặc chinchilla của bạn chắc chắn sẽ thích sự pha trộn phong phú này của các hốc Oxbow cao cấp. Chúng tôi tự tay lựa chọn và pha trộn Western Timothy và Orchard Grass để tạo ra sự pha trộn hoàn hảo của hương vị và kết cấu.'),
(10289, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ Oxbow Harvest Stacks Compressed Hay Western Timothy with Chamomile Small Animal Fo', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-oxbow-harvest-stacks-compressed-hay-western-timothy-with-chamomile-small-animal-food-2.jpg', 50, 130000, 'OXBOW', 'Sản phẩm này được tạo ra để cung cấp các lợi ích tương tự của cỏ khô mà không có sự lộn xộn. Được làm bằng hoa cúc cho một món ngon mà thú cưng của bạn với tình yêu!\r\nMón ngon này có nhiều chất xơ và sẽ giúp thú cưng của bạn giữ một hệ thống tiêu hóa khỏe mạnh.'),
(10290, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ Oxbow Harvest Stacks Compressed Hay Western Timothy with Carrots Small Animal Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-oxbow-harvest-stacks-compressed-hay-western-timothy-with-carrots-small-animal-food.jpg', 50, 130000, 'OXBOW', 'Sản phẩm này được tạo ra để cung cấp các lợi ích tương tự của cỏ khô mà không có sự lộn xộn. Được làm bằng hoa cúc cho một món ngon mà thú cưng của bạn với tình yêu!\r\nMón ngon này có nhiều chất xơ và sẽ giúp thú cưng của bạn giữ một hệ thống tiêu hóa khỏe mạnh.'),
(10291, 'Đồ ăn, chăm sóc, sức khỏe, thỏ', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho thỏ Oxbow Harvest Stacks Compressed Hay Western Timothy Small Animal Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-tho-oxbow-harvest-stacks-compressed-hay-western-timothy-small-animal-food.jpg', 50, 120000, 'OXBOW', 'Sản phẩm này được tạo ra để cung cấp các lợi ích tương tự của cỏ khô mà không có sự lộn xộn. Món ngon này có nhiều chất xơ và sẽ giúp thú cưng của bạn giữ một hệ thống tiêu hóa khỏe mạnh.'),
(10292, 'Đồ ăn, chăm sóc, sức khỏe, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho chuột Hamster Oxbow Garden Select Hamster & Gerbil Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-chuot-hamster-oxbow-garden-select-hamster-gerbil-food-2.jpg', 50, 600000, 'OXBOW', 'Nó có các thành phần vườn chất lượng cao như đậu Hà Lan vàng, cà chua, hương thảo và húng tây để cung cấp cho người bạn lông của bạn với dinh dưỡng đầy đủ và cân bằng. Công thức không biến đổi gen này cũng bao gồm ba loại cỏ khô được lựa chọn bằng tay cho nhiều loại và chất xơ thiết yếu.'),
(10293, 'Đồ ăn, chăm sóc, sức khỏe, chuột', 'Đồ ăn cho thỏ và chuột', 'Thức ăn cho chuột Chinchilla Oxbow Garden Select Chinchilla Food', 'https://www.vietpet.net/wp-content/uploads/2020/01/thuc-an-cho-chuot-chinchilla-oxbow-garden-select-chinchilla-food-2.jpg', 50, 360000, 'OXBOW', 'Nó có các thành phần vườn chất lượng cao như đậu Hà Lan vàng, cà chua, hương thảo và húng tây để cung cấp cho người bạn lông của bạn với dinh dưỡng đầy đủ và cân bằng. Công thức không biến đổi gen này cũng bao gồm ba loại cỏ khô được lựa chọn bằng tay cho nhiều loại và chất xơ thiết yếu.'),
